/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 FUNCTION `fn_getCompromiso`(p_producto varchar(50), p_date1 varchar(50), p_date2 varchar(50),p_compromiso1 varchar(50), p_compromiso2 varchar(50)) RETURNS varchar(50) CHARSET latin1
BEGIN
declare p_result varchar(50);
set p_result = case 
					when p_date1 = 'true' and p_date2='' then p_compromiso1
					when p_date1 = 'no_pagara' and p_date2='true' then p_compromiso2
					when p_date1 = 'no_pagara' and p_date2='no_pagara' then 'no_pagara'
                    when p_date1 = 'no_pagara' and p_date2='ya_pago' then 'ya_pago'
                    when p_date1 = 'no_pagara' and p_date2 in ('NOINPUT','NOMATCH','','+1') then 'no_pagara'
                    when p_date1 = 'ya_pago' and p_date2='' then 'ya_pago'
                    when p_date1 = 'NOINPUT' and p_date2='' then 'NOINPUT'
                    when p_date1 = 'NOMATCH' and p_date2='' then 'NOMATCH'
                    when p_date1 = '' and p_date2='' then 'llamada_terminada'
				end;
if p_producto = '' then
set p_result='';
end if;
return p_result;
END */;;
