/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 FUNCTION `fn_getMaxAttemptByResult`(p_callresult int, p_treatment int, p_chainN int) RETURNS int(11)
BEGIN

declare v_MaxAttempts int;


select s.max_attempts into v_MaxAttempts
from statuses_in_treatment s 
where s.treatment_id=p_treatment
and s.call_result=p_callresult
and FIND_IN_SET(p_chainN, s.chain_list)>0
limit 1;

if ISNULL(v_MaxAttempts)
then 
  
	select s.max_attempts into v_MaxAttempts
	from statuses_in_treatment s 
	where s.treatment_id=p_treatment
  and s.call_result=p_callresult
	and s.chain_list='0'
	limit 1;
end if;

if ISNULL(v_MaxAttempts)
then 
  
	select max_attempts into v_MaxAttempts 
	from cfg_treatments 
	where id=p_treatment
	and active=1;
end if;

if (ISNULL(v_MaxAttempts) or v_MaxAttempts<1)
then 
  
  set v_MaxAttempts=1;
end if;

return v_MaxAttempts;

END */;;
DELIMITER ;
