/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 FUNCTION `fn_TraduceCodigoTermino`(
										p_codigo_termino varchar(50)
									 ) RETURNS varchar(50) CHARSET latin1
BEGIN
declare p_result varchar(50);

set p_result = 
case when p_codigo_termino ='ANSWER' then 'Contesta'				
     when p_codigo_termino ='NOANSWER' then 'No Contesta'
     when p_codigo_termino ='BUSY' then  'Tono Ocupado'
     when p_codigo_termino ='MACHINE' then 'Voice Mail'     
     when p_codigo_termino ='NOTSURE' then 'Otro'
     when p_codigo_termino ='UNKNOW' then 'Sin Tipificacion'
	 else 'Sin Tipificacion'
end;
return p_result;
END */;;
