/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 PROCEDURE `20171228_spw_cdr_SelectCallDetail`(in p_resultType varchar(1)
,in p_startTime datetime
,in p_endTime datetime
,in p_srcPhone varchar(32)
,in p_dstPhone varchar(32)
,in p_callType varchar(128)
,in p_callResult varchar(128)
,in p_campaign int
,in p_survey int
,in p_start int
,in p_limit int)
selectCallDetail:BEGIN
SET SESSION TRANSACTION ISOLATION LEVEL READ UNCOMMITTED;

SET group_concat_max_len = 10000;

DROP TEMPORARY TABLE IF EXISTS tempRepo;
DROP TEMPORARY TABLE IF EXISTS tempRepoCols;
DROP TEMPORARY TABLE IF EXISTS tempCdrResult;
DROP TEMPORARY TABLE IF EXISTS tempLogSurvey;


create temporary table tempRepoCols (
  colnum int auto_increment
	,colname varchar(32)
	,colalias varchar(32)
  ,key(colnum)
);



insert into tempRepoCols(colname, colalias) values
("start_time", "Fecha Llamada"),
("src_number", "Numero Origen"),
("dst_number","Numero Destino"),
("call_type", "Tipo Llamada"),
("duration", "Duracion"),
("talk_time", "Tiempo Hablado"),
("call_result", "Resultado"),
("campaign_name", "Campaña"),
("survey_name", "Servicio"),
("import_id", "Id Carga"),
("chain_id", "C.I Contacto");



SET @colSurveys = NULL;
if (p_campaign>0 or p_survey>0) 
then 
  SET @colNameAndAlias = NULL;
  if (p_campaign>0)
  then 
		SELECT GROUP_CONCAT(DISTINCT CONCAT("('",shortname,"','",replace(shortname,' ','_'),"')")) 
          , GROUP_CONCAT(DISTINCT CONCAT('max(case when l.question_name = ''',shortname,''' then l.response_text else '''' end) AS ',
							REPLACE(shortname,' ','_')))
		INTO @colNameAndAlias,@colSurveys
		FROM
		(
			select distinct shortname 
			from cfg_questions
			where survey_id in (
						select distinct survey_id 
						from global_call 
						where start_time between p_StartTime and p_EndTime 
						and campaign_id=p_campaign
            and not survey_id is null 
      )
			and viewrepo=1
			order by questionnum
		)d;
	else 
		SELECT GROUP_CONCAT(DISTINCT concat("('",shortname,"','",replace(shortname,' ','_'),"')")) 
				, GROUP_CONCAT(DISTINCT CONCAT('max(case when l.question_name = ''',shortname,''' then l.response_text else '''' end) AS ',
							REPLACE(shortname,' ','_')))
		INTO @colNameAndAlias,@colSurveys
		FROM
		(
			select distinct shortname 
			from cfg_questions
			where survey_id=p_survey
			and viewrepo=1
			order by questionnum
		)d;
  end if;

	set @sqlStmt=CONCAT("insert into tempRepoCols(colname,colalias) values ", @colNameAndAlias);
	PREPARE stmt FROM @sqlStmt;
	EXECUTE stmt;
end if;



if (p_resultType='H')
then 
	select * from tempRepoCols;
  LEAVE selectCallDetail;
end if;



set @sqlStmt=NULL;
set @sqlStmt=CONCAT("select g.connid
,DATE_FORMAT(g.start_time,'%Y-%m-%d %H:%i:%s') as start_time
,g.src as src_number
,g.dst as dst_number
,g.calltype as call_type
,SEC_TO_TIME(g.duration) as duration
,SEC_TO_TIME(g.billsec) as talk_time
,r.code_name as call_result
,cp.shortname as campaign_name
,s.shortname as survey_name
,g.import_id as import_id
,g.chain_id as chain_id
from global_call g
inner join v_callresult r on (g.call_result=r.code_enum)
left join cfg_campaigns cp on (g.campaign_id=cp.id)
left join cfg_callinglist cl on (g.callinglist_id=cl.id)
left join cfg_surveys s on (g.survey_id=s.id)
where g.start_time between '",p_startTime,"' and '",p_endTime,"'");


if(p_campaign>0) then 
	set @sqlStmt = CONCAT(@sqlStmt," and g.campaign_id=",p_campaign);
end if;

if(p_survey >0)  
then 
	set @sqlStmt=CONCAT(@sqlStmt," and g.survey_id=",p_survey);
end if;


if(LENGTH(p_callType)>0 and INSTR(p_callType,",")=0)
then 
	set @sqlStmt=CONCAT(@sqlStmt," and g.calltype='",p_callType,"'");
end if;


if(LENGTH(p_callResult)>0 and INSTR(p_callResult,",")=0)
then 
	set @sqlStmt=CONCAT(@sqlStmt," and g.call_result=",p_callResult);
elseif(LENGTH(p_callResult)>0 and INSTR(p_callResult,",")>0)
then 
	set @sqlStmt=CONCAT(@sqlStmt," and g.call_result in (",p_callResult ,")");
end if;


if(LENGTH(p_srcPhone)>0)
then 
	set @sqlStmt=CONCAT(@sqlStmt," and g.src='",p_srcPhone,"'");
end if;


if(LENGTH(p_dstPhone)>0)
then 
	set @sqlStmt=CONCAT(@sqlStmt," and g.dst='",p_dstPhone,"'");
end if;

set @sqlStmt=CONCAT("CREATE TEMPORARY TABLE tempCdrResult (INDEX(connid)) AS (",@sqlStmt,")");
prepare stmt from @sqlStmt;
execute stmt;


IF (p_campaign>0 or p_survey>0) 
THEN 
	set @sqlStmt=NULL;
  set @sqlStmt= CONCAT("CREATE TEMPORARY TABLE tempLogSurvey (INDEX(connid)) AS (
									select l.connid,",@colSurveys," 
									from logs_survey_interactions l 
									inner join (
										select max(id) as id
										,uniqueid
										,survey_id
										,question_name
										from logs_survey_interactions 
										where crr_time between '",p_startTime,"' and '",p_endTime,"'");
	if (p_survey>0) then 
		set @sqlStmt = CONCAT(@sqlStmt," and survey_id=",p_survey);
	end if;
	if (p_campaign>0) then 
		set @sqlStmt = CONCAT(@sqlStmt," and campaign_id=",p_campaign);
	end if;

	set @sqlStmt= CONCAT(@sqlStmt," and eventname='next'
										group by uniqueid
										,survey_id
										,question_name
									) as tb1 on l.id=tb1.id
									where l.crr_time between '",p_startTime,"' and '",p_endTime,"'");

	if (p_survey>0) then 
		set @sqlStmt = CONCAT(@sqlStmt," and l.survey_id=",p_survey);
	end if;
	if (p_campaign>0) then 
		set @sqlStmt = CONCAT(@sqlStmt," and l.campaign_id=",p_campaign);
	end if;

	set @sqlStmt = CONCAT(@sqlStmt," and l.eventname='next' group by l.connid)");

	prepare stmt from @sqlStmt;
	execute stmt;

END IF;


SET @colNameAndAlias = NULL;
SELECT GROUP_CONCAT(DISTINCT colname) 
INTO @colNameAndAlias
FROM(
		select colname
		from tempRepoCols
		order by colnum
)d;

set @sqlStmt=NULL;
IF (p_campaign>0 or p_survey>0) 
then 
  
	set @sqlStmt=CONCAT("CREATE TEMPORARY TABLE tempRepo AS ( select ",@colNameAndAlias," from tempCdrResult c left join tempLogSurvey l on c.connid=l.connid )");
else 
  
	set @sqlStmt=CONCAT("CREATE TEMPORARY TABLE tempRepo AS ( select ",@colNameAndAlias," from tempCdrResult )");
end if;

prepare stm from @sqlStmt;
execute stm;

select FOUND_ROWS() into @rowCount;

set @sqlStmt="select *,@rowCount as rowCount from tempRepo";
if(p_limit>0)
then 
	set @sqlStmt=CONCAT(@sqlStmt," limit ",p_start,", ",p_limit);
end if;

PREPARE stmt FROM @sqlStmt;
EXECUTE stmt;
DEALLOCATE PREPARE stmt;

DROP TEMPORARY TABLE IF EXISTS tempRepo;
DROP TEMPORARY TABLE IF EXISTS tempRepoCols;
DROP TEMPORARY TABLE IF EXISTS tempCdrResult;
DROP TEMPORARY TABLE IF EXISTS tempLogSurvey;

END */;;
DELIMITER ;
