/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 PROCEDURE `20171228_spw_SelectAllImportData`(in p_import INT)
BEGIN


DROP TABLE IF EXISTS tempRecords;
DROP TABLE IF EXISTS tempSurveys;


select l.tablename into @tablename 
from cfg_imports i
inner join cfg_callinglist l on (i.callinglist_id=l.id)
where i.id=p_import;


SET @customCols = NULL;
SELECT GROUP_CONCAT(DISTINCT dt) INTO @customCols
FROM
(
  select distinct f.fldname as dt
  from cfg_imports i
  inner join field_in_format fif on (i.format_id=fif.format_id)
  inner join cfg_fields f on (fif.field_id=f.id)
  where i.id=p_import
  and f.userfield=1
) d;



SET @sqlStmt= NULL;
SET @sqlStmt= CONCAT("CREATE TEMPORARY TABLE tempRecords (INDEX(chain_id))
AS 
(
	select ",@customCols,"
  ,chain_id
  ,contact_info
  ,call_time
  ,v.code_name as 'call_result'
   from ",@tablename," 
   inner join v_callresult v on (v.code_enum=call_result)
	where import_id=",p_import,"
);");

PREPARE stmt FROM @sqlStmt;
EXECUTE stmt;


SET @customCols = NULL;
SELECT GROUP_CONCAT(DISTINCT
    CONCAT('max(case when l.question_name = ''',dt,
      ''' then l.response_text else '''' end) AS `',dt, '`')
		) INTO @customCols
FROM
(
  select distinct l.question_name as dt
	from tempRecords r 
	inner join logs_survey_interactions l on (r.chain_id=l.chain_id)
  inner join cfg_questions q on (l.survey_id=q.survey_id and l.question_id=q.id)
	where l.import_id=p_import
  and l.eventname='next'
  and q.viewrepo=1
) d;

if @customCols is null 
then 
	select * from tempRecords;

else
	
	set @sqlStmt=CONCAT("CREATE TEMPORARY TABLE tempSurveys (INDEX(chain_id)) AS (
										SELECT r.chain_id,",@customCols," 
										from tempRecords r 
										inner join logs_survey_interactions l on (r.chain_id=l.chain_id)
										inner join (
												select max(lg.id) as id
												,lg.survey_id
												,lg.question_id   
												,lg.chain_id
												from logs_survey_interactions lg
												where lg.import_id=",p_import,"
												group by lg.survey_id
												,lg.question_id   
												,lg.chain_id
										) l2 on (l.id=l2.id)
										where l.import_id=",p_import,"
										and l.eventname='next' group by r.chain_id)");

	PREPARE stmt FROM @sqlStmt;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;

	
	select r.*,s.*
	from tempRecords r
	left join tempSurveys s on (r.chain_id=s.chain_id);

end if;


DROP TABLE IF EXISTS tempRecords;
DROP TABLE IF EXISTS tempSurveys;

END */;;
DELIMITER ;
