/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 PROCEDURE `20171228_spw_stat_ImportStatusSummary`(in p_campaign int)
BEGIN 

select c.tablename into @tableName
from cfg_callinglist c
inner join callinglist_in_campaign cp on (c.id=cp.callinglist_id)
where cp.campaign_id=p_campaign
limit 1;

SET @successCodes = NULL;
SELECT GROUP_CONCAT(code_enum) INTO @successCodes
FROM(
		select code_enum 
		from v_callresult 
		where contact_type='SUCCESS'
)d;

SET @failCodes = NULL;
SELECT GROUP_CONCAT(code_enum) INTO @failCodes
FROM(
		select code_enum 
		from v_callresult 
		where contact_type='FAIL'
)d;

drop temporary table if exists tempStat;
create temporary table tempStat(
campaign_id int,
import_day varchar(24),
import_id int,
n_records_total int,
n_records_available int,
n_records_terminate int,
n_calls_process int,
n_calls_answer int,
avg_calls_answer int,
n_calls_others int,
avg_calls_others int
);

set @sqlStmt=CONCAT("insert into tempStat
(campaign_id,import_day,import_id,n_records_total,n_records_available,n_records_terminate,n_calls_process,n_calls_answer,n_calls_others)"
,"select ", p_campaign,"
,date(crr_time) as import_day
,import_id
,count(*) as n_records_total
,sum(case when (record_type=1 or record_type=2) then 1 else 0 end) as n_records_available
,sum(case when record_type=3 then 1 else 0 end) as n_records_terminate
,sum(case when call_result>0 then 1 else 0 end) as n_calls_process
,sum(case when call_result in (",@successCodes,") then 1 else 0 end) as n_calls_answer
,sum(case when call_result in (",@failCodes,") then 1 else 0 end) as n_calls_others
from ",@tableName,"
where campaign_id=",p_campaign,"
group by date(crr_time)
,import_id");

PREPARE stmt FROM @sqlStmt;
EXECUTE stmt;
DEALLOCATE PREPARE stmt;

update tempStat
set avg_calls_answer=(case when n_calls_process=0 then 0 else (n_calls_answer/n_calls_process)*100 end) 
,avg_calls_others=(case when n_calls_process=0 then 0 else (n_calls_others/n_calls_process)*100 end);

select * from tempStat;
drop temporary table if exists tempStat;

END */;;
DELIMITER ;
