      ,mrcp_opts=case when v_retryMrcpOpts='' then mrcp_opts else v_retryMrcpOpts end;

		end if;

		select s.*,q.*,v_responseResult as 'response_result' 
		from tempSurvey s,tempQuestion q;
end if;

drop temporary table if exists tempQuestion;
drop temporary table if exists tempSurvey;

END */;;
DELIMITER ;
