/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 PROCEDURE `spw_RecycleCallinglist`(in p_import int)
BEGIN

DECLARE v_count INT;
DECLARE v_recordID INT;
DECLARE done INT DEFAULT FALSE;
DECLARE c_result CURSOR FOR select * from tempResult;
DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

SET SESSION TRANSACTION ISOLATION LEVEL READ UNCOMMITTED;

SET @successCodes = NULL;
SELECT GROUP_CONCAT(code_enum) INTO @successCodes
FROM(
		select code_enum 
		from v_callresult 
		where contact_type='SUCCESS'
)d;

SET @failCodes = NULL;
SELECT GROUP_CONCAT(code_enum) INTO @failCodes
FROM(
		select code_enum 
		from v_callresult 
		where contact_type='FAIL'
)d;

select l.tablename into @tablename 
from cfg_imports i
inner join cfg_callinglist l on (i.callinglist_id=l.id)
where i.id=p_import;

drop temporary table if exists  tempResult;
set @sqlStmt=NULL;
set @sqlStmt=CONCAT("create temporary table tempResult as( select record_id 
									from ",@tablename," as tb1
									where tb1.import_id=",p_import,"
                  and tb1.call_result in (",@failCodes,")
									and not EXISTS (
											select 1 from ",@tablename," as tb2
											where tb2.import_id=tb1.import_id
											and tb2.chain_id =tb1.chain_id 
											and tb2.call_result in (",@successCodes,")
										));");

prepare stm from @sqlStmt;
execute stm;

set v_count=0;

OPEN c_result;
read_loop: LOOP
FETCH c_result INTO v_recordID;
IF done THEN
	LEAVE read_loop;
END IF;

set @sqlStmt=CONCAT("update ",@tablename," set record_type=1
					,record_status=1
					,attempts=0
					,call_result=0
          ,call_time=NULL 
          ,sched_time=NULL
					,recycle_count=recycle_count+1
					,recycle_lasttime=CURRENT_TIMESTAMP()
					where record_id=",v_recordID);
prepare stm from @sqlStmt;
execute stm;

set v_count=v_count+1;

END LOOP;
CLOSE c_result;

COMMIT;

drop temporary table tempResult;
select v_count as row_affected;

END */;;
DELIMITER ;
