/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 PROCEDURE `spw_RecycleCallinglistByCallresult`(in p_import int, in p_callresult varchar(255))
BEGIN

DECLARE v_count INT;
DECLARE v_recordID INT;
DECLARE done INT DEFAULT FALSE;
DECLARE c_result CURSOR FOR select * from tempRecords;
DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

SET SESSION TRANSACTION ISOLATION LEVEL READ UNCOMMITTED;

SET @successCodes = NULL;
