where i.id=p_import;

drop temporary table if exists tempRecords;

set @sqlStmt=NULL;
set @sqlStmt=CONCAT("create temporary table tempRecords ( select record_id 
									from ",@tablename," as tb1
									where tb1.import_id=",p_import,"
                  and tb1.call_result in (",p_callresult,")
									and not EXISTS (
											select 1 from ",@tablename," as tb2
											where tb2.import_id=tb1.import_id
											and tb2.chain_id =tb1.chain_id 
											and (tb2.call_result in (",@successCodes,")
													and tb2.call_result not in (",p_callresult,"))
										));");

prepare stm from @sqlStmt;
execute stm;

set v_count=0;

OPEN c_result;
read_loop: LOOP
FETCH c_result INTO v_recordID;
IF done THEN
	LEAVE read_loop;
END IF;

set @sqlStmt=CONCAT("update ",@tablename," set record_type=1
					,record_status=1
					,attempts=0
					,call_result=0
          ,call_time=NULL 
          ,sched_time=NULL
					,recycle_count=recycle_count+1
					,recycle_lasttime=CURRENT_TIMESTAMP()
					where record_id=",v_recordID);
prepare stm from @sqlStmt;
execute stm;

set v_count=v_count+ROW_COUNT();

END LOOP;
CLOSE c_result;

COMMIT;

drop temporary table tempRecords;

select v_count as row_affected;

END */;;
