/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 PROCEDURE `spw_RecycleCallinglistByResponse`(in p_import int,
in p_question int,
in p_response varchar(32),
in p_recycleTo varchar(32))
BEGIN

DECLARE v_count INT;
DECLARE v_record INT;
DECLARE v_chain VARCHAR(32);
DECLARE done INT DEFAULT FALSE;
DECLARE c_result CURSOR FOR select * from tempRecords;
DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

select l.tablename into @tablename 
from cfg_imports i
inner join cfg_callinglist l on (i.callinglist_id=l.id)
where i.id=p_import;

drop temporary table if exists tempRecords;
create temporary table tempRecords as (
	select distinct l.record_id,l.chain_id
	from logs_survey_interactions l
	inner join (
			select max(id) as id
			,survey_id
			,question_id
			,uniqueid
			from logs_survey_interactions 
			where import_id=p_import
			and question_id=p_question
      group by survey_id
			,question_id
			,uniqueid
	) l2 on l.id=l2.id
	where l.import_id=p_import
	and l.question_id=p_question
	and l.response_code=p_response
);

set v_count=0;

OPEN c_result;
read_loop: LOOP
FETCH c_result INTO v_record,v_chain;
IF done THEN
	LEAVE read_loop;
END IF;

set @sqlStmt=CONCAT("update ",@tablename," set record_type=1
					,record_status=1
					,attempts=0
					,call_result=0
          ,call_time=NULL 
          ,sched_time=NULL
					,recycle_count=recycle_count+1
					,recycle_lasttime=CURRENT_TIMESTAMP()");

if(p_recycleTo='tocontact')
then 
	set @sqlStmt=CONCAT(@sqlStmt," where import_id=",p_import," and chain_id='",v_chain,"' and (record_type>1 and record_status>1)");
else 
	set @sqlStmt=CONCAT(@sqlStmt," where record_id=",v_record," and (record_type>1 and record_status>1)");
end if;

prepare stm from @sqlStmt;
execute stm;

set v_count=v_count+ROW_COUNT();

END LOOP;
CLOSE c_result;

drop temporary table if exists tempRecords;

select v_count as row_affected;

END */;;
DELIMITER ;
