/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 PROCEDURE `spw_SelectCallinglistData`(in p_callinglist int, in p_campaign int, in p_start int, in p_limit int,in p_search varchar(15000))
BEGIN

SET SESSION TRANSACTION ISOLATION LEVEL READ UNCOMMITTED;


select cl.tablename,cli.filterby,cli.orderby
into @tableName,@filterBy,@orderBy
from callinglist_in_campaign cli
inner join cfg_callinglist cl on cli.callinglist_id=cl.id
where cl.id=p_callinglist
and cli.campaign_id=p_campaign
;

SET group_concat_max_len = 10000;

SET @colNames=NULL;
SELECT GROUP_CONCAT(
				case 
					when fldname='record_id' then fldname
					when fldname='record_type' then CONCAT("(select code_name from v_recordtype where code_enum=",fldname,") AS ",fldname)
          when fldname='record_status' then CONCAT("(select code_name from v_recordstatus where code_enum=",fldname,") AS ",fldname)
          when fldname='call_result' then CONCAT("(select code_name from v_callresult where code_enum=",fldname,") AS ",fldname)
					else CONCAT("CAST(",fldname," AS CHAR) AS ",fldname) 
				end
				) 
INTO @colNames
FROM
(
  select f.fldname
	from field_in_callinglist fcl
	inner join cfg_fields f on fcl.field_id=f.id
	where fcl.callinglist_id=p_callinglist
) d;

DROP TEMPORARY TABLE IF EXISTS tempRecords;

set @sqlStmt=NULL;
set @sqlStmt=CONCAT("CREATE TEMPORARY TABLE tempRecords AS(
					select ",@colNames," from ",@tableName," 
				where campaign_id=",p_campaign,"
        and callinglist_id=",p_callinglist);

if CHAR_LENGTH(@filterBy)>0 then 
	set @filterBy=REPLACE(@filterBy, '$F', ' ');
  set @sqlStmt=CONCAT(@sqlStmt," ", @filterBy);
end if; 

set @sqlStmt=CONCAT(@sqlStmt," )");
prepare stm from @sqlStmt;
execute stm;

set @totalCount=0;
set @sqlStmt="select count(*) into @totalCount from tempRecords";
prepare stm from @sqlStmt;
execute stm;

set @sqlStmt="select *,@totalCount totalCount from tempRecords";

if (CHAR_LENGTH(p_search )>0) then 
  set @sqlStmt=CONCAT(@sqlStmt," where ",p_search);
end if;

if CHAR_LENGTH(@orderBy)>0 then 
	set @orderBy=REPLACE(@orderBy, '$F', ',');
  set @sqlStmt=CONCAT(@sqlStmt," order by ",@orderBy);
end if; 

set @sqlStmt=CONCAT(@sqlStmt," limit ",p_start,",",p_limit);

prepare stm from @sqlStmt;
execute stm;

END */;;
DELIMITER ;
