/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 PROCEDURE `spw_SelectCfgResponsesByImport`(in p_id int)
BEGIN

select campaign_id into @campaign
from cfg_imports
where id=p_id;

select r.question_id as question
,r.response_code as response
,concat(q.shortname,":",r.response_label) as itemText
from cfg_campaigns cp 
inner join cfg_surveys s on (s.dnis=cp.routingnumber)
inner join cfg_questions q on (s.id=q.survey_id)
inner join (
		select distinct
		question_id
		,responsecode as response_code
		,responsetext as response_label
		from responses_in_questions
		
		union all
		select distinct 
		question_id 
		,attempt_type as response_code
		,attempt_type as response_label
		from retry_in_questions
		
) r on (r.question_id=q.id) 
where cp.id=@campaign
and q.viewrepo=1
order by q.questionnum
;

END */;;
DELIMITER ;
