DELIMITER ;;
/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 PROCEDURE `spw_SelectImportData`(in p_import INT)
BEGIN

DROP TABLE IF EXISTS tempRecords;
DROP TABLE IF EXISTS tempContacts;
DROP TABLE IF EXISTS tempSurveys;

select f.chainmode,l.tablename
into @chainMode,@tablename 
from cfg_imports i
inner join cfg_formats f on (i.format_id=f.id)
inner join cfg_callinglist l on (i.callinglist_id=l.id)
where i.id=p_import;

SET @customCols = NULL;
SELECT GROUP_CONCAT(DISTINCT dt
  ) INTO @customCols
FROM
(
  select distinct f.fldname as dt
  from cfg_imports i
  inner join field_in_format fif on (i.format_id=fif.format_id)
  inner join cfg_fields f on (fif.field_id=f.id)
  where i.id=p_import
  and f.userfield=1
) d;

if @chainMode='H'
then 

SET @sqlStmt = NULL;
set @sqlStmt=CONCAT("CREATE TEMPORARY TABLE tempRecords (INDEX(chain_id))
AS 
(
	select chain_id,",@customCols," from ",@tablename,"_import
	where import_id=",p_import,"
);");

PREPARE stmt FROM @sqlStmt;
EXECUTE stmt;


SET @sqlStmt = NULL;
set @sqlStmt=CONCAT("CREATE TEMPORARY TABLE tempContacts(INDEX(chain_id))
AS 
(
	select t1.chain_id
	,t1.contact_info
	,t1.call_time
	,(select v.code_name from v_callresult v where v.code_enum=t1.call_result) as 'call_result'
	from ",@tablename," t1
	where t1.import_id=",p_import,"
	and t1.call_time=(
		select max(t2.call_time)
		from ",@tablename," t2
		where t2.import_id=t1.import_id 
		and t2.chain_id=t1.chain_id
	)
)"
);

PREPARE stmt FROM @sqlStmt;
EXECUTE stmt;

else 

SET @sqlStmt = NULL;
set @sqlStmt=CONCAT("CREATE TEMPORARY TABLE tempContacts (INDEX(chain_id))
AS 
(
	select ",@customCols,"
  ,chain_id
  ,contact_info
  ,call_time
  ,(select v.code_name from v_callresult v where v.code_enum=call_result) as 'call_result'
   from ",@tablename," 
	where import_id=",p_import,"
);");

PREPARE stmt FROM @sqlStmt;
EXECUTE stmt;

end if;





SET @customCols = NULL;
SELECT
  GROUP_CONCAT(DISTINCT
    CONCAT(
      'max(case when l.question_name = ''',dt,
      ''' then l.response_text else '''' end) AS `',
      dt, '`'
    )
  ) INTO @customCols
FROM
(
  select distinct l.question_name as dt
	from tempContacts r 
	inner join logs_sourvey_interactions l on (r.chain_id=l.chain_id)
	where r.call_result='ANSWER'
  and l.eventname='next'
  and l.import_id=p_import
) d;

if(@customCols is null and @chainMode='H')
then 
	select r.*,c.*
	from tempRecords r
	left join tempContacts c on (r.chain_id=c.chain_id);

elseif(@customCols is null and @chainMode='V')
then
	select c.* 
  from tempContacts c;

elseif(not @customCols is null)
then
	
	set @sqlStmt=CONCAT("CREATE TEMPORARY TABLE tempSurveys (INDEX(chain_id)) AS (
									SELECT r.chain_id,",@customCols," 
									from tempContacts r 
									inner join logs_sourvey_interactions l on r.chain_id=l.chain_id
									where l.import_id=",p_import,"
									and r.call_result='ANSWER'
									and l.eventname='next'
									and l.attempt=(
											select max(l2.attempt) 
											from logs_sourvey_interactions l2 
											where l2.survey_id=l.survey_id 
											and l2.question_id=l.question_id
											and l2.uniqueid=l.uniqueid 
											) 
									)");

	PREPARE stmt FROM @sqlStmt;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;

	
	select r.*,c.*,s.*
	from tempRecords r
	left join tempContacts c on (r.chain_id=c.chain_id)
	left join tempSurveys s on (r.chain_id=s.chain_id);

end if;


DROP TABLE IF EXISTS tempRecords;
DROP TABLE IF EXISTS tempContacts;
DROP TABLE IF EXISTS tempSurveys;

END */;;
DELIMITER ;
