/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 PROCEDURE `spw_stat_ImportStatusSummary`(in p_campaign int)
BEGIN 

select c.tablename,cp.filterby into @tableName,@filterBy
from cfg_callinglist c
inner join callinglist_in_campaign cp on (c.id=cp.callinglist_id)
where cp.campaign_id=p_campaign
limit 1;

SET @successCodes = NULL;
SELECT GROUP_CONCAT(code_enum) INTO @successCodes
FROM(
		select code_enum 
		from v_callresult 
		where contact_type='SUCCESS'
)d;

SET @failCodes = NULL;
SELECT GROUP_CONCAT(code_enum) INTO @failCodes
FROM(
		select code_enum 
		from v_callresult 
		where contact_type='FAIL'
)d;

drop temporary table if exists tempStat;
create temporary table tempStat(
campaign_id int,
import_id int,
import_dialmode int,
import_dialpriority int,
import_status int,
import_filename varchar(128),
import_startdate datetime,
import_starttime time,
n_records_total int,
n_records_available int,
n_records_terminate int,
n_calls_process int,
n_calls_answer int,
avg_calls_answer int,
n_calls_others int,
avg_calls_others int
);

set @sqlStmt=CONCAT("insert into tempStat
(campaign_id,import_id,import_dialmode,import_dialpriority,import_status,import_filename,import_startdate,import_starttime,n_records_total,n_records_available,n_records_terminate,n_calls_process,n_calls_answer,n_calls_others)"
,"select ", p_campaign,"
,i.id
,i.dialmode
,i.dialpriority
,i.importstatus
,i.filename
,case when i.sched_startdate is null then CURRENT_DATE() else i.sched_startdate end
,case when i.sched_starttime is null then '00:00:00' else i.sched_starttime end
,count(*) as n_records_total
,sum(case when (ct.record_type=1 or ct.record_type=2) then 1 else 0 end) as n_records_available
,sum(case when ct.record_type=3 then 1 else 0 end) as n_records_terminate
,sum(case when ct.call_result>0 then 1 else 0 end) as n_calls_process
,sum(case when ct.call_result in (",@successCodes,") then 1 else 0 end) as n_calls_answer
,sum(case when ct.call_result in (",@failCodes,") then 1 else 0 end) as n_calls_others
from ",@tableName," ct
inner join cfg_imports i on ct.import_id=i.id
where ct.campaign_id=",p_campaign,"
and i.importstatus=3");

if(not @filterBy is null and LENGTH(@filterBy)>0)
then 
	set @sqlStmt=CONCAT(@sqlStmt," ",@filterBy);
end if;

set @sqlStmt=CONCAT(@sqlStmt," group by i.id
				,i.dialmode
				,i.dialpriority
				,i.importstatus
				,i.filename
				,i.sched_startdate
				,i.sched_starttime");

PREPARE stmt FROM @sqlStmt;
EXECUTE stmt;
DEALLOCATE PREPARE stmt;

update tempStat
set avg_calls_answer=(case when n_calls_process=0 then 0 else (n_calls_answer/n_calls_process)*100 end) 
,avg_calls_others=(case when n_calls_process=0 then 0 else (n_calls_others/n_calls_process)*100 end);

set @rownum=0;
select (@rownum := @rownum + 1) AS row_number
,t.* 
from tempStat t
order by 
t.import_startdate asc
,t.import_starttime asc
,t.import_dialmode desc
,t.import_dialpriority desc
;

drop temporary table if exists tempStat;

END */;;
DELIMITER ;
