/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 PROCEDURE `spw_stat_LogInteractionSurveys`(in stat varchar(32),in p_id int)
BEGIN

SET SESSION TRANSACTION ISOLATION LEVEL READ UNCOMMITTED; 

set @currentDay=CURRENT_DATE();

if stat='Stat_Survey_Summary'
then
	select survey_name as statName
	,count(*) as statVal
	from  logs_survey_interactions
	where crr_time >@currentDay
	and eventname='start'
  and not survey_name is null
	group by survey_name
	;

elseif stat='Stat_Responses_InSurvey'
then 
	select stat as statType
  ,s1.question_id as categoryId
  ,s1.question_name as categoryName
	,s1.response_text as statName
	,count(*) as statVal
	from logs_survey_interactions s1
  inner join (
		select max(id) as id
		,uniqueid
		,survey_id
		,question_name
		from logs_survey_interactions 
		where crr_time>@currentDay
    and survey_id=p_id
		and eventname='next'
		group by uniqueid
		,survey_id
		,question_name
	) as s2 on s1.id=s2.id
  inner join (
		select id as question_id from cfg_questions q 
    where q.survey_id=p_id
    and q.viewstat=1
  ) as q on s1.question_id=q.question_id 
	where s1.crr_time>@currentDay
  and s1.survey_id=p_id 
	and s1.eventname='next'
	group by s1.question_id
	,s1.question_name
	,s1.response_text
	;

elseif stat='Stat_Responses_ByImport'
then 
	select s1.survey_id
	,s1.survey_name
	,s1.question_num as categoryId
	,s1.question_name as categoryName
	,s1.response_text as statName
	,count(*) as statVal
	from logs_survey_interactions as s1
  inner join (
		select max(id) as id
		,uniqueid
		,survey_id
		,question_name
		from logs_survey_interactions 
		where import_id=p_id
		and eventname='next'
		group by uniqueid
		,survey_id
		,question_name
	) as s2 on s1.id=s2.id
  inner join (
		select id as question_id from cfg_questions q 
    where q.viewstat=1
  ) as q on s1.question_id=q.question_id 
	where s1.import_id=p_id
	and s1.eventname='next'
	group by s1.survey_id
	,s1.survey_name
	,s1.question_num
	,s1.question_name
	,s1.response_text
	;

elseif stat='Stat_Questions_InSurvey'
then
	select stat as statType
	,s1.question_id as categoryId
  ,s1.question_name as categoryName
  ,s1.question_name as statName
	,count(DISTINCT s1.uniqueid) as statVal
	from  logs_survey_interactions as s1
  inner join (
		select id as question_id from cfg_questions q 
    where q.survey_id=p_id
    and q.viewstat=1
  ) as q on s1.question_id=q.question_id 
	where s1.crr_time>@currentDay
  and s1.survey_id=p_id
	and s1.eventname='next'
	group by s1.question_id,s1.question_name
	;

end if;

END */;;
DELIMITER ;
