/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 PROCEDURE `spw_stat_OutboundCallVolume`(in p_stat varchar(64),in p_campaign int)
BEGIN

SET SESSION TRANSACTION ISOLATION LEVEL READ UNCOMMITTED;

set @currentDay=CURRENT_DATE();

SET @successCodes = NULL;
SELECT GROUP_CONCAT(code_enum) INTO @successCodes
FROM(
		select code_enum 
		from v_callresult_success
)d;



if p_stat='Stat_Campaign_CallResult' 
then
	select r.code_name as statName
  ,r.code_color as statColor
	,count(*) as statVal
	from global_call g
	inner join v_callresult r on (g.call_result=r.code_enum)
	where g.start_time>=@currentDay
  and g.campaign_id=p_campaign
	and g.calltype='Outbound'
	group by r.code_name,r.code_color
	;


elseif p_stat='Stat_Campaign_CallResult_LastHour' 
then
	select r.code_name as statName
  ,r.code_color as statColor
	,count(*) as statVal
	from global_call g
	inner join v_callresult r on (g.call_result=r.code_enum)
	where  g.start_time>CURRENT_DATE()
  and TIMEDIFF(CURRENT_TIMESTAMP(),g.start_time)<=SEC_TO_TIME(3600)
  and g.campaign_id=p_campaign
	and g.calltype='Outbound'
	group by r.code_name,r.code_color 
	;


elseif p_stat='Stat_Campaign_Summary_ByHour' 
then
	set @sqlStmt=concat("select DATE(g.start_time) as fecha
	,CONCAT(TIME_FORMAT(g.start_time,'%H'),':00') as statCategory 
  ,sum(case when g.call_result in (",@successCodes,") then 1 else 0 end) as n_total_answer
  ,sum(1) as n_total_calls
	,sum(case when g.call_result in (",@successCodes,") then g.billsec else 0 end) as talk_time
	from global_call g
  inner join cfg_campaigns cp on (g.campaign_id=cp.id)
	where g.start_time>CURRENT_DATE()-1
  and TIMEDIFF(CURRENT_TIMESTAMP(),g.start_time)<=SEC_TO_TIME(86400)
  and g.campaign_id=",p_campaign,"
  and g.calltype='Outbound'
	group by DATE(g.start_time)
	,CONCAT(TIME_FORMAT(g.start_time,'%H'),':00') ");
	
	prepare stm from @sqlStmt;
	execute stm;


elseif p_stat='Stat_Campaign_Progress' 
then
	set @sqlStmt=concat("select sum(case when call_result in (",@successCodes,") then billsec else 0 end) as talk_time
  ,sum(case when call_result in (",@successCodes,") then 1 else 0 end) as n_total_answer
	,count(*) as n_total_calls
	from global_call 
	where start_time>='",@currentDay,"'
	and calltype='Outbound'
	and campaign_id=",p_campaign);

	prepare stm from @sqlStmt;
	execute stm;

elseif p_stat='Stat_All_CallResult' 
then
	select r.code_name as statName
  ,r.code_color as statColor
	,count(*) as statVal
	from global_call g
	inner join v_callresult r on (g.call_result=r.code_enum)
	where g.start_time>=@currentDay
	and g.calltype='Outbound'
	group by r.code_name, r.code_color
	;

elseif p_stat='Stat_All_Summary_ByHour' 
then
	set @sqlStmt=concat("select DATE(g.start_time) as fecha
	,CONCAT(TIME_FORMAT(g.start_time,'%H'),':00') as statCategory 
  ,sum(case when g.call_result in (",@successCodes,") then 1 else 0 end) as n_total_answer
  ,sum(1) as n_total_calls
	,sum(case when g.call_result in (",@successCodes,") then g.billsec else 0 end) as talk_time
	from global_call g
  inner join cfg_campaigns cp on (g.campaign_id=cp.id)
	where g.start_time>CURRENT_DATE()-1
  and TIMEDIFF(CURRENT_TIMESTAMP(),g.start_time)<=SEC_TO_TIME(86400)
  and g.calltype='Outbound'
	group by DATE(g.start_time)
	,CONCAT(TIME_FORMAT(g.start_time,'%H'),':00')");

	prepare stm from @sqlStmt;
	execute stm;

elseif p_stat='Stat_All_CallResult_LastHour' 
then
	select r.code_name as statName
  ,r.code_color as statColor
	,count(*) as statVal
	from global_call g
	inner join v_callresult r on (g.call_result=r.code_enum)
	where TIMEDIFF(CURRENT_TIMESTAMP(),g.start_time)<=SEC_TO_TIME(3600)
	and g.calltype='Outbound'
	group by r.code_name,r.code_color
	;

elseif p_stat='Stat_All_Progress' 
then
	set @sqlStmt=concat("select sum(case when call_result in (",@successCodes,") then billsec else 0 end) as talk_time
  ,sum(case when call_result in (",@successCodes,") then 1 else 0 end) as n_total_answer
	,count(*) as n_total_calls
	from global_call 
	where start_time>='",@currentDay,"'
	and calltype='Outbound'");
	
	prepare stm from @sqlStmt;
	execute stm;

elseif p_stat='Stat_All_Call_ByCampaign' 
then
	select c.shortname as statCategory
  ,r.code_name as statName
	,count(*) as statVal
	from global_call g
	inner join cfg_campaigns c on (g.campaign_id=c.id)
  inner join v_callresult r on (g.call_result=r.code_enum)
	where g.start_time>=@currentDay
	and g.calltype='Outbound'
	group by c.shortname,r.code_name
	;

end if;

END */;;
DELIMITER ;
