/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 PROCEDURE `spw_stat_RecordCallResult`(in p_statName varchar(32),in p_campaign int, in p_import int)
BEGIN
SET SESSION TRANSACTION ISOLATION LEVEL READ UNCOMMITTED;

set @currentDay=CURRENT_DATE();

drop temporary table if exists tempStat;
create temporary table tempStat (
	categoryId int default 0,
	categoryName varchar(80) default '',
	statName varchar(80) default '',
	statVal int default 0,
	statPercent int default 0,
	statColor varchar(32) default ''
);

SET @successCodes = NULL;
SELECT GROUP_CONCAT(code_enum) INTO @successCodes
FROM(
		select code_enum 
		from v_callresult_success
)d;

SET @failCodes = NULL;
SELECT GROUP_CONCAT(code_enum) INTO @failCodes
FROM(
		select code_enum 
		from v_callresult_fail
)d;

select l.tablename,c.shortname 
into @tableName,@campaignName
from callinglist_in_campaign cl
inner join cfg_callinglist l on (cl.callinglist_id=l.id)
inner join cfg_campaigns c on (cl.campaign_id=c.id)
where c.id=p_campaign 
limit 1;

set @sqlStmt=NULL;


IF p_statName='Stat_Record_CallResult_Summary'
THEN
	set @n_answer_calls=0;
	set @n_others_calls=0;

	SET @sqlStmt=CONCAT("select sum(case when call_result in (",@successCodes,") then 1 else 0 end)  
	,sum(case when call_result in (",@failCodes,") then 1 else 0 end) 
	into @n_answer_calls,@n_others_calls
	from ",@tableName,"
	where call_time>'",@currentDay,"'
  and campaign_id=",p_campaign,"
  and call_result>0"
	);

	PREPARE stmt FROM @sqlStmt;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;

  if @n_answer_calls is null then set @n_answer_calls=0; end if;
  if @n_others_calls is null then set @n_others_calls=0; end if;

	insert into tempStat(categoryId,categoryName,statName,statVal)
	values(1,@campaignName,'Contactados',@n_answer_calls)
	,(2,@campaignName,'NoContactados',@n_others_calls);

		
	select * from tempStat;
  

ELSEIF p_statName='Stat_Record_CallResult' 
THEN

	set @sqlStmt=CONCAT("insert into tempStat(categoryId,categoryName,statName,statColor,statVal)
   select 1
  ,'CallResult'
  ,r.code_name
  ,r.code_color
	,count(*)
	from ",@tableName," ct
	inner join v_callresult r on (ct.call_result=r.code_enum)
	where ct.call_time>=CURRENT_DATE()
  and ct.call_result>0
	and ct.campaign_id=",p_campaign,"
	group by r.code_name,r.code_color");
  
  PREPARE stmt FROM @sqlStmt;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;

		
	select * from tempStat;


ELSEIF p_statName='Stat_Record_CallResult_ByCall' 
THEN

	set @sqlStmt=CONCAT("insert into tempStat(categoryId,categoryName,statName,statColor,statVal)
		select 2
		,'CallResultByCall'
		,r.code_name
    ,r.code_color
		,count(*)
		from global_call g
		inner join v_callresult r on (g.call_result=r.code_enum)
		where g.start_time>=CURRENT_DATE()
		and g.campaign_id=",p_campaign,"
		group by r.code_name,r.code_color");
  
  PREPARE stmt FROM @sqlStmt;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;

		
	select * from tempStat;


ELSEIF p_statName='Stat_Record_CallResult_ByImport' 
THEN

	set @sqlStmt=CONCAT("insert into tempStat(categoryId,categoryName,statName,statColor,statVal)
						select 1,'CallResult',r.code_name,r.code_color,count(*)
								from ",@tableName," c
                inner join v_callresult r on (c.call_result=r.code_enum)
								where c.campaign_id=",p_campaign,"
								and c.import_id=",p_import,"
								group by r.code_name,r.code_color");

	PREPARE stmt FROM @sqlStmt;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;

		
	select * from tempStat;


ELSEIF p_statName='Stat_Record_StatusInCampaign' 
THEN

set @n_scheduled=0;
set @n_progress=0;
set @n_created=0;
set @n_finished=0;
set @sqlStmt=CONCAT("select sum(case when (record_type=1 and record_status=3) then 1 else 0 end) 
,sum(case when (record_type=2 and record_status=2) then 1 else 0 end) 
,sum(case when (record_type=4 and record_status=1) then 1 else 0 end) 
,sum(case when (record_type=3) then 1 else 0 end) 
into @n_scheduled,@n_progress,@n_created,@n_finished
from ",@tableName,"
where call_time>=CURRENT_DATE()
and campaign_id=",p_campaign);

PREPARE stmt FROM @sqlStmt;
EXECUTE stmt;

if @n_scheduled>0 then
	insert into tempStat(categoryId,categoryName,statName,statColor,statVal)
	values(1,'RecordStatus','EnAgenda','',@n_scheduled);
end if;

if @n_progress>0
then 
	insert into tempStat(categoryId,categoryName,statName,statColor,statVal)
	values(2,'RecordStatus','EnProgreso','',@n_progress);
end if;

if @n_finished>0
then 
	insert into tempStat(categoryId,categoryName,statName,statColor,statVal)
	values(3,'RecordStatus','Terminados','',@n_finished);
end if;

if @n_created>0 
then 
	insert into tempStat(categoryId,categoryName,statName,statColor,statVal)
	values(4,'RecordStatus','Nuevos','',@n_created); 
end if;

select * from tempStat;

END IF;

drop temporary table tempStat;

COMMIT;
END */;;
DELIMITER ;
