/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 PROCEDURE `spw_stat_RecordStatusInImport`(in p_import int)
BEGIN

drop temporary table if exists tempStat;
drop temporary table if exists tempTableCT;

create TEMPORARY table tempStat (
statId int default 0,
categoryId int default 0,
categoryName varchar(80) default '',
statName varchar(80) default '',
statVal int default 0
);

select l.tablename into @tableName
from cfg_imports i
inner join cfg_formats f on (i.format_id=f.id)
inner join cfg_callinglist l on (f.callinglist_id=l.id)
where i.id=p_import;


SET SESSION TRANSACTION ISOLATION LEVEL READ UNCOMMITTED; 
SET @sqlStmt=concat("create temporary table tempTableCT(INDEX(record_type,record_status)) as(
select chain_id,record_type,record_status from ",@tableName,"
where import_id=",p_import,");");
PREPARE stmt FROM @sqlStmt;
EXECUTE stmt;
DEALLOCATE PREPARE stmt;
COMMIT;


select count(*) into @totalAvailable

from tempTableCT
where record_type=1;


select count(*) into @totalDone
from tempTableCT
where record_type=3;


select count(*) into @totalRetrive 
from tempTableCT
where record_type=2;

drop temporary table if exists tempTableCT;


if @totalAvailable is null then set @totalAvailable=0; end if;
if @totalDone is null then set @totalDone=0; end if;
if @totalRetrive is null then set @totalRetrive=0; end if;

set @totalImport=(@totalAvailable+@totalRetrive+@totalDone);


insert into tempStat values
(1,1,'RecordStatus','Total',@totalImport),
(2,1,'RecordStatus','Available',@totalAvailable),
(3,1,'RecordStatus','Done',@totalDone)
;

select * from tempStat;

drop temporary table if exists tempStat;

END */;;
DELIMITER ;
