/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 PROCEDURE `spw_stat_RecordStatusInTable_Unique`(in p_campaign int, in p_import int)
BEGIN

SET SESSION TRANSACTION ISOLATION LEVEL READ UNCOMMITTED;

select l.tablename into @tableName
from cfg_callinglist l
inner join callinglist_in_campaign lc on (l.id=lc.callinglist_id)
where lc.campaign_id=p_campaign
order by l.id asc 
limit 1;


drop temporary table if exists tempStatReady;
drop temporary table if exists tempStatRescheduled;
drop temporary table if exists tempStatHandled;
drop temporary table if exists tempStatRetrive;
drop temporary table if exists tempStatDiscarted;
drop temporary table if exists tempTableCT;


SET @sqlStmt=concat("create temporary table tempTableCT(INDEX(chain_id),INDEX(record_type,record_status)) as(
select chain_id,record_type,record_status from ",@tableName,"
where campaign_id=",p_campaign," and import_id=",p_import,");");
PREPARE stmt FROM @sqlStmt;
EXECUTE stmt;
DEALLOCATE PREPARE stmt;


create temporary table tempStatReady (INDEX(chain_id)) as(
select distinct chain_id 
from tempTableCT
where record_type=1 
and record_status=1);


create temporary table tempStatRescheduled (INDEX(chain_id)) as(
select distinct chain_id 
from tempTableCT
where record_type=1 
and record_status=3);


create temporary table tempStatHandled (INDEX(chain_id)) as(
select distinct chain_id 
from tempTableCT
where record_type=3
and record_status=4);


create temporary table tempStatRetrive (INDEX(chain_id)) as(
select distinct chain_id 
from tempTableCT
where record_type=2);


create temporary table tempStatDiscarted (INDEX(chain_id)) as (
select distinct chain_id
from tempTableCT t1
where record_type=3
and record_status=6);

delete t1.* from tempStatDiscarted t1
inner join tempStatReady rd on (rd.chain_id=t1.chain_id);

delete t1.* from tempStatDiscarted t1
inner join tempStatRescheduled rs on (rs.chain_id=t1.chain_id);

delete t1.* from tempStatDiscarted t1
inner join tempStatHandled hd on (hd.chain_id=t1.chain_id);

delete t1.* from tempStatDiscarted t1
inner join tempStatRetrive rt on (rt.chain_id=t1.chain_id);

select count(*) into @totalReady from tempStatReady;
select count(*) into @totalRescheduled from tempStatRescheduled;
select count(*) into @totalHandled from tempStatHandled;
select count(*) into @totalRetrive from tempStatRetrive;
select count(*) into @totalDiscarted from tempStatDiscarted;


if @totalReady is null then set @totalReady=0; end if;
if @totalRescheduled is null then set @totalRescheduled=0; end if;
if @totalHandled is null then set @totalHandled=0; end if;
if @totalRetrive is null then set @totalRetrive=0; end if;
if @totalDiscarted is null then set @totalDiscarted=0; end if;

set @totalImport=(@totalReady+@totalRescheduled+@totalHandled+@totalDiscarted);


drop temporary table tempStatReady;
drop temporary table tempStatRescheduled;
drop temporary table tempStatHandled;
drop temporary table tempStatRetrive;
drop temporary table tempStatDiscarted;
drop temporary table tempTableCT;


select 1 as categoryId
,'Total Registros' as categoryName
,'ID Unico' as statName
,@totalImport as statVal
union all 
select 2 as categoryId
,'Disponibles' as categoryName
,'Disponibles' as statName
,(@totalReady+@totalRescheduled) as statVal
union all 
select 3 as categoryId
,'Disponibles' as categoryName
,'Sin Intentos' as statName
,@totalReady as statVal
union all 
select 3 as categoryId
,'Disponibles' as categoryName
,'En Agenda' as statName
,@totalRescheduled as statVal
union all 
select 4 as categoryId
,'Terminados' as categoryName
,'Terminados' as statName
,(@totalHandled+@totalDiscarted) as statVal
union all 
select 5 as categoryId
,'Terminados' as categoryName
,'Contactados' as statName
,@totalHandled as statVal
union all 
select 5 as categoryId
,'Terminados' as categoryName
,'No Contactados' as statName
,@totalDiscarted as statVal
;

END */;;
DELIMITER ;
