/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 PROCEDURE `spw_survey_SelectExplorerRecords`(in p_resultType varchar(1)
,in p_StartTime datetime
,in p_EndTime datetime
,in p_campaign int
,in p_survey int 
,in p_phone varchar(32)
,in p_duration varchar(4)
,in p_advancedFilters varchar(2000))
selectExplorerRecords:BEGIN

SET SESSION TRANSACTION ISOLATION LEVEL READ UNCOMMITTED; 

SET group_concat_max_len = 10000;


DROP TEMPORARY TABLE IF EXISTS tempSurveys;
DROP TEMPORARY TABLE IF EXISTS tempRecords;
DROP TEMPORARY TABLE IF EXISTS tempRepoCols;


if p_phone ='' then set p_phone =null; end if;
if p_duration ='' then set p_duration =null; end if;
if p_advancedFilters ='' then set p_advancedFilters=null; end if;

SET @successCodes = NULL;
SELECT GROUP_CONCAT(code_enum) INTO @successCodes
FROM(
		select code_enum 
		from v_callresult_success
)d;

create temporary table tempRepoCols (
  colnum int auto_increment
	,colname varchar(32)
	,colalias varchar(32)
  ,key(colnum)
);

insert into tempRepoCols(colname, colalias) values
("monitor", ""),
("global_id", "Callid"),
("start_time","Fecha"),
("call_type", "Tipo Llamada"),
("phone", "Telefono"),
("call_result", "Resultado"),
("talk_time", "Duración"),
("campaign_name", "Campaña"),
("survey_name", "Servicio"),
("chain_id", "C.I Contacto");

SET @colSurveys = NULL;
if (p_campaign>0 or p_survey>0) 
then 
	SET @colNameAndAlias = NULL;
  if (p_campaign>0)
  then 
		SELECT GROUP_CONCAT(DISTINCT CONCAT("('",shortname,"','",replace(shortname,' ','_'),"')")) 
          , GROUP_CONCAT(DISTINCT CONCAT('max(case when l.question_name = ''',shortname,''' then l.response_text else '''' end) AS ',
							REPLACE(shortname,' ','_')))
		INTO @colNameAndAlias,@colSurveys
		FROM
		(
			select shortname 
			from cfg_questions
			where survey_id in (
						select distinct survey_id 
						from global_call 
						where start_time between p_StartTime and p_EndTime 
						and campaign_id=p_campaign
            and not survey_id is null 
      )
			and viewrepo=1
			order by questionnum
		)d;
	else 
		SELECT GROUP_CONCAT(DISTINCT concat("('",shortname,"','",replace(shortname,' ','_'),"')")) 
				, GROUP_CONCAT(DISTINCT CONCAT('max(case when l.question_name = ''',shortname,''' then l.response_text else '''' end) AS ',
							REPLACE(shortname,' ','_')))
		INTO @colNameAndAlias,@colSurveys
		FROM
		(
			select shortname 
			from cfg_questions
			where survey_id=p_survey
			and viewrepo=1
			order by questionnum
		)d;
  end if;

  if ((@colNameAndAlias is null) or  (@colSurveys is null)) 
	then 
		set p_campaign=0;
		set p_survey=0;
  else 
		SET @sqlStmt= CONCAT("insert into tempRepoCols(colname,colalias) values ", @colNameAndAlias);
		PREPARE stmt FROM @sqlStmt;
		EXECUTE stmt;
	end if;
	
end if;



if p_resultType ='H'
then 
	select * from tempRepoCols;
  LEAVE selectExplorerRecords;
end if;




if (p_campaign>0 or p_survey>0) 
then 

SET @sqlStmt = CONCAT("CREATE TEMPORARY TABLE tempSurveys (INDEX(uniqueid)) AS (
						SELECT l.uniqueid,l.cdata01,",@colSurveys,"
            from logs_survey_interactions l 
            inner join (
							select max(id) as id
              ,survey_id
							,question_id
							,uniqueid
							from logs_survey_interactions 
							where crr_time between '",p_StartTime,"' and '",p_EndTime,"'");
if (p_survey>0) then 
	SET @sqlStmt = CONCAT(@sqlStmt," and survey_id=",p_survey);
end if;
if (p_campaign>0) then 
	SET @sqlStmt = CONCAT(@sqlStmt," and campaign_id=",p_campaign);
end if;
             
SET @sqlStmt = CONCAT(@sqlStmt," group by survey_id
							,question_id
							,uniqueid
						) as tb1 on l.id=tb1.id
            where l.crr_time between '",p_StartTime,"' and '",p_EndTime,"'");

if (p_survey>0) then 
	SET @sqlStmt = CONCAT(@sqlStmt," and l.survey_id=",p_survey);
end if;

if (p_campaign>0) then 
	SET @sqlStmt = CONCAT(@sqlStmt," and l.campaign_id=",p_campaign);
end if;


IF NOT p_phone IS NULL
THEN
	SET @sqlStmt= CONCAT(@sqlStmt," and l.phone='",p_phone,"'");
END IF;

SET @sqlStmt= CONCAT(@sqlStmt," and l.eventname='next' group by l.uniqueid,l.cdata01)");

PREPARE stmt FROM @sqlStmt;
EXECUTE stmt;

end if;


SET @sqlStmt=CONCAT("CREATE TEMPORARY TABLE tempRecords (INDEX(linkedid)) AS( 
select g.linkedid
,g.id as global_id
,g.monitor
,DATE_FORMAT(g.start_time,'%Y-%m-%d %H:%i:%s') as start_time
,g.calltype as call_type
,case when g.calltype='Inbound' then g.src else g.dst end as phone
,r.code_name as call_result
,TIME_FORMAT(SEC_TO_TIME(g.billsec),'%H:%i:%s') as talk_time
,cp.shortname as campaign_name
,sv.shortname as survey_name
,g.chain_id 
from global_call g  
inner join v_callresult r on (r.code_enum=g.call_result)
left join cfg_campaigns cp on (g.campaign_id=cp.id)
left join cfg_surveys sv on (g.survey_id=sv.id)
where g.start_time between '",p_StartTime,"' and '",p_EndTime,"'
and g.monitor='yes'");


IF NOT p_phone IS NULL
THEN
	SET @sqlStmt= CONCAT(@sqlStmt," and (case when g.calltype='Inbound' then g.src else g.dst end)='",p_phone,"'");
END IF;

IF p_survey >0 THEN
	SET @sqlStmt= CONCAT(@sqlStmt," and g.survey_id=",p_survey);
END IF;

IF (p_campaign>0) THEN 
	SET @sqlStmt = CONCAT(@sqlStmt," and g.campaign_id=",p_campaign);
END IF;

IF NOT p_duration IS NULL
THEN
	SET @sqlStmt= CONCAT(@sqlStmt," and g.duration ",p_duration);
END IF;

SET @sqlStmt= CONCAT(@sqlStmt," )");

PREPARE stmt FROM @sqlStmt;
EXECUTE stmt;

SET @colNameAndAlias = NULL;
SELECT GROUP_CONCAT(DISTINCT colname) 
INTO @colNameAndAlias
FROM(
		select colname
		from tempRepoCols
		order by colnum
)d;

set @sqlStmt=NULL;
if (p_campaign>0 or p_survey>0) 
then 
  
	set @sqlStmt=CONCAT("select ",@colNameAndAlias," from tempRecords c left join tempSurveys l on c.linkedid=l.uniqueid");
else 
  
	set @sqlStmt=CONCAT("select ",@colNameAndAlias," from tempRecords");
end if;

IF NOT p_advancedFilters  IS NULL
THEN
	SET @sqlStmt= CONCAT(@sqlStmt,' where ',p_advancedFilters);
END IF;

prepare stm from @sqlStmt;
execute stm;
DEALLOCATE PREPARE stmt;


DROP TEMPORARY TABLE IF EXISTS tempSurveys;
DROP TEMPORARY TABLE IF EXISTS tempRecords;
DROP TEMPORARY TABLE IF EXISTS tempRepoCols;

END */;;
DELIMITER ;
