/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 PROCEDURE `sp_api_SendData`(in p_campaign int)
BEGIN

SET SESSION TRANSACTION ISOLATION LEVEL READ UNCOMMITTED; 

drop temporary table if exists tempCalls;
drop temporary table if exists tempSurveys;

set @tablename=NULL;
select cl.tablename into @tablename
from callinglist_in_campaign cli 
inner join cfg_callinglist cl on (cli.callinglist_id=cl.id)
where cli.campaign_id=p_campaign ;

create temporary table tempCalls (index(record_id)) as (
	select * from global_call
	where start_time>CURRENT_DATE()
  and TIMEDIFF(CURRENT_TIMESTAMP(),end_time)<=SEC_TO_TIME(120)
  and campaign_id=p_campaign 
);

create temporary table tempSurveys (index(record_id)) as (
	select * from logs_survey_interactions
	where crr_time>CURRENT_DATE()
  and campaign_id=p_campaign 
);

set @sqlStmt=CONCAT("select gc.uniqueid as uniqueid
,ct.record_id
,ct.import_id
,ct.campaign_id
,cp.shortname as campaign_name
,ct.callinglist_id
,ct.chain_id
,ct.nombre
,ct.apellido_pat
,ct.contact_info
,ct.chain_n
,ct.record_type
,ct.record_status
,ct.attempts
,ct.call_result
,cr.code_name as nombre_resultado
,ct.call_time
,ct.sched_time
,ls.attempt as question_attempt
,ls.question_id
,ls.question_name as Nombre_Pregunta
,ls.response_text as Respuesta_Cliente
,ls.survey_id
,ls.survey_dnis
from ",@tablename," as ct
inner join v_callresult as cr on (ct.call_result=cr.code_enum) 
inner join cfg_campaigns as cp on (ct.campaign_id=cp.id)
inner join tempCalls as gc on (ct.record_id=gc.record_id)
left join tempSurveys as ls on (ct.record_id=ls.record_id )
where ct.call_time>CURRENT_DATE()
and ct.campaign_id=",p_campaign);

PREPARE stmt FROM @sqlStmt;
EXECUTE stmt;

drop temporary table if exists tempCalls;
drop temporary table if exists tempSurveys;

END */;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
