/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = '' */ ;
DELIMITER ;;
/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 PROCEDURE `sp_core_SelectContactData`(in p_campaign int, in p_callinglist int, in p_phone varchar(32), in p_chain varchar(16))
BEGIN
SET SESSION TRANSACTION ISOLATION LEVEL READ UNCOMMITTED;


select tablename into @tablename
from cfg_callinglist
where id=p_callinglist;


SET @attachedFields=NULL;
SELECT GROUP_CONCAT(DISTINCT fldname) 
INTO @attachedFields
FROM
(
  select f.fldname 
	from field_in_callinglist fcl
	inner join cfg_fields f on fcl.field_id=f.id
	where fcl.callinglist_id=p_callinglist
	and fcl.attached=1
) d;

drop temporary table if exists tempRecord;

set @attachedFields=CONCAT(@attachedFields,',record_type');


set @sqlStmt= CONCAT("create temporary table tempRecord as (select ",@attachedFields," from ",@tablename
					," where replace(replace(lower(chain_id),'-',''),'.','')='",p_chain,"' and campaign_id=",p_campaign," and callinglist_id=",p_callinglist," limit 1);");
prepare stm from @sqlStmt;
execute stm;

set @record=0;
select record_id into @record from tempRecord;
if(@record is null or @record=0) then

	set @sqlStmt=CONCAT("insert into ",@tablename," (call_time,callinglist_id,campaign_id,contact_info,chain_id,record_type,record_status,call_result,attempts)"
						," values(CURRENT_TIMESTAMP(),",p_callinglist,",",p_campaign,",'",p_phone,"','",p_chain,"',4,1,5,1)");
 
  prepare stm from @sqlStmt;
	execute stm;

  insert into tempRecord(record_id,contact_info,campaign_id,chain_id,record_type)
  values(LAST_INSERT_ID(),p_phone,p_campaign,p_chain,4);
else 

	set @sqlStmt=CONCAT("update ",@tablename," set contact_info='",p_phone,"'"
						,",call_time=CURRENT_TIMESTAMP(),attempts=attempts+1,call_result=5"
						,",record_type=case when record_type=4 then record_type else 3 end,record_status=case when record_type=4 then record_status else 4 end"
						," where record_id=",@record);

	prepare stm from @sqlStmt;
	execute stm;
end if;

COMMIT;


select * from tempRecord;
drop temporary table tempRecord;

END */;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
/*!50003 DROP PROCEDURE IF EXISTS `sp_core_SelectNextRecord` */;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
/*!50003 SET character_set_client  = utf8 */ ;
/*!50003 SET character_set_results = utf8 */ ;
/*!50003 SET collation_connection  = utf8_general_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = '' */ ;
DELIMITER ;;
/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 PROCEDURE `sp_core_SelectNextRecord`(in p_campaign INT, in p_dialrule int)
selectNextRecord:BEGIN

declare v_TimeconditionId INT;
declare v_CampaignName VARCHAR(32);
declare v_ExternalRouting VARCHAR(32);
declare v_RoutingType VARCHAR(32);
declare v_RoutingNumber VARCHAR(32);
declare v_OverflowType VARCHAR(32);
declare v_OverflowNumber VARCHAR(32);
declare v_CallingListId INT;
declare v_Tablename VARCHAR(32);
declare v_VoiceLang VARCHAR(12);
declare v_RecordId INT;
declare v_ChainId VARCHAR(32);
declare v_TreatmentId INT;
declare v_Monitor INT;
declare v_filterBy varchar(1500);
declare v_orderBy varchar(1500);
declare v_CallerIdNum VARCHAR(12);
declare v_AmdActive INT;
declare v_CampaignGreeting INT;
declare v_GreetingPlayType VARCHAR(32);
declare v_GreetingFilename VARCHAR(128);
declare v_GreetingText VARCHAR(255);
declare v_SilenceDetection INT;
declare v_SilenceRecogOpts VARCHAR(255);

SET SESSION TRANSACTION ISOLATION LEVEL READ UNCOMMITTED;


SELECT case when cp.shortname is null then '' else cp.shortname end  
,case when cp.timecondition_id is null then 0 else cp.timecondition_id end 
,case when cp.externalrouting is null then '' else cp.externalrouting end
,case when cp.routingtype is null then '' else cp.routingtype end
,case when cp.routingnumber is null then '' else cp.routingnumber end
,case when cp.overflowtype is null then '' else cp.overflowtype end
,case when cp.overflownumber is null then '' else cp.overflownumber end
,case when cp.voicelang is null then '' else cp.voicelang end
,case when cp.callernumber is null then '' else cp.callernumber end
,case when cp.monitor=true then '1' else '0'  end
,case when cp.amd=true then '1' else '0'  end
,case when gt.campaign_id is null then '0' else '1' end
,case when gt.greeting_playtype is null then '' else gt.greeting_playtype end
,case when gt.greeting_filename is null then '' else gt.greeting_filename end
,case when gt.greeting_text is null then '' else gt.greeting_text end
,case when gt.silence_detection=true then '1' else '0' end
,case when gt.silence_recogopts is null then '' else gt.silence_recogopts end
,cp.active
,ss.dialing
INTO  
v_CampaignName
,v_TimeconditionId
,v_ExternalRouting
,v_RoutingType
,v_RoutingNumber
,v_OverflowType
,v_OverflowNumber
,v_VoiceLang
,v_CallerIdNum
,v_Monitor
,v_AmdActive
,v_CampaignGreeting
,v_GreetingPlayType
,v_GreetingFilename
,v_GreetingText
,v_SilenceDetection
,v_SilenceRecogOpts
,@campaignActive
,@dialingStatus 
FROM cfg_campaigns as cp
INNER JOIN dialing_sessions ss on (cp.id=ss.campaign_id)
LEFT JOIN (
				select c.id as campaign_id
				,g.playtype as greeting_playtype
				,case when g.playtype='SOUND_FILE' then (select filename from cfg_soundfiles where id=m.greetingsound_id) 
							else '' end as greeting_filename
				,m.greetingtext as greeting_text
				,g.mrcp_recogopts as silence_recogopts
				,g.silencedetection as silence_detection
				from cfg_campaigns c 
				inner join cfg_greetings g on c.greeting_id=g.id
				inner join messages_in_greeting m on g.id=m.greeting_id
				where c.id=p_campaign
        and g.active=1
        and current_time() between m.start_time and m.end_time
				limit 1
		)as gt on (cp.id=gt.campaign_id) 
WHERE cp.id=p_campaign
;


if not @campaignActive
then 
  update dialing_sessions set dialing=0,stoptime=CURRENT_TIMESTAMP()  
  where campaign_id=p_campaign and dialing>0;
	select "stopped" as retval
			,concat("la campana id=",p_campaign," se encuentra inactiva") as retmessage;
	LEAVE selectNextRecord;
end if;


if NOT EXISTS(select 1 from cfg_timeconditions where id=v_TimeconditionId and active=1)
then
  update dialing_sessions set dialing=2,pausetime=CURRENT_TIMESTAMP()  
    where campaign_id=p_campaign and dialing=1;
	select "stopped" as retval
			,concat("la campana id=",p_campaign," no tiene un calendario activo asignado") as retmessage;
	LEAVE selectNextRecord;
end if;


if EXISTS(select 1 from cfg_timeconditions where id=v_TimeconditionId and NOT startdate is NULL and NOT enddate is NULL)
and NOT EXISTS (select 1 from cfg_timeconditions where id=v_TimeconditionId and CURRENT_DATE() between startdate and enddate)
then
	update dialing_sessions set dialing=2,pausetime=CURRENT_TIMESTAMP()  
    where campaign_id=p_campaign and dialing=1;
	select "stopped" as retval
		,concat("la campana id=",p_campaign," se encuentra fuera de fechas") as retmessage;
	LEAVE selectNextRecord;
end if;


if EXISTS(select 1 from cfg_holidays where timecondition_id=v_TimeconditionId
															and nday=DAYOFMONTH(CURRENT_DATE()) 
															and nmonth=MONTH(CURRENT_DATE()) 
															and active=1)
then
  update dialing_sessions set dialing=2,pausetime=CURRENT_TIMESTAMP()  
  where campaign_id=p_campaign and dialing=1;
  select "stopped" as retval
			,concat("la campana id=",p_campaign," se encuentra dia festivo") as retmessage;
	LEAVE selectNextRecord;
end if;


if not EXISTS(select 1 from cfg_schedules where timecondition_id=v_TimeconditionId 
												and wday=(case when DAYOFWEEK(now())=1 then 7 else DAYOFWEEK(now()) -1 end)
												and CURRENT_TIME() between starttime and endtime)
then
    update dialing_sessions set dialing=2,pausetime=CURRENT_TIMESTAMP()  
    where campaign_id=p_campaign and dialing=1;
		select "stopped" as retval
			,concat("la campana id=",p_campaign," se encuentra fuera de horario") as retmessage;
	  LEAVE selectNextRecord;
end if;


if @dialingStatus=0 
then 
	select "stopped" as retval
		,concat("sesion de discado inactiva para la campana id=",p_campaign) as retmessage;
	 LEAVE selectNextRecord;

elseif(@dialingStatus=2) 
then 
  
	update dialing_sessions set dialing=1,starttime=CURRENT_TIMESTAMP() 
  where campaign_id=p_campaign;
end if;


select cl.id,cl.tablename,cli.treatment_id,cli.filterby,cli.orderby 
into v_CallingListId,v_Tablename,v_TreatmentId,v_filterBy,v_orderBy
from callinglist_in_campaign cli
inner join cfg_callinglist cl on cli.callinglist_id=cl.id
where campaign_id=p_campaign
and cl.active=1
and cli.active=1
limit 1;


if ISNULL(v_CallingListId)
then 
 select "stopped" as retval
			,concat("la campana id=",p_campaign," no tiene asignado un callinglist") as retmessage;
 LEAVE selectNextRecord;
end if;


if CHAR_LENGTH(v_filterby)>0 then 
	set v_filterBy=REPLACE(v_filterBy, '$F', ' ');
end if; 

if CHAR_LENGTH(v_orderBy)>0 then 
	set v_orderBy=REPLACE(v_orderBy, '$F', ',');
end if; 


SET @attachedFields=NULL;
SELECT GROUP_CONCAT(DISTINCT fldname) 
INTO @attachedFields
FROM
(
  select f.fldname 
	from field_in_callinglist fcl
	inner join cfg_fields f on fcl.field_id=f.id
	where fcl.callinglist_id=v_CallingListId
	and fcl.attached=1
) d;

if ISNULL(@attachedFields)
then 
 select "stopped" as retval
			,concat("la tabla ",v_Tablename," no tiene fields asignados") as retmessage;
 LEAVE selectNextRecord;
end if;






select dialpattern into @dialPattern 
from outrules_in_campaign
where id=p_dialrule 
and campaign_id=p_campaign ;



SET @attachedFields=CONCAT("'",v_CampaignName,"' as campaign_name"
												,",'",v_Tablename,"' as callinglist_name"
												,",'",v_RoutingType,"' as routing_type"
												,",'",v_RoutingNumber,"' as routing_number"
												,",'",v_OverflowType,"' as overflow_type"
												,",'",v_OverflowNumber,"' as overflow_number"
												,",'",v_Monitor,"' as monitor" 	
												,",'",v_VoiceLang,"' as voice_lang"
												,",'",v_ExternalRouting,"' as external_routing"
                        ,",'",v_CallerIdNum,"' as callerid_num"
												,",'",v_AmdActive,"' as amd_active" 	
												,",'",v_CampaignGreeting,"' as campaign_greeting" 	
												,",'",v_GreetingPlayType,"' as greeting_playtype" 	
												,",'",v_GreetingFilename,"' as greeting_filename" 
												,",'",v_GreetingText,"' as greeting_text" 
												,",'",v_SilenceDetection,"' as silence_detection" 
												,",'",v_SilenceRecogOpts,"' as silence_recogopts" 
												,",",@attachedFields
											);

 
set @tempTableName=concat('temp_',v_Tablename);

set @sqlStmt=CONCAT('DROP TEMPORARY TABLE IF EXISTS ',@tempTableName);
prepare stm from @sqlStmt;
execute stm;


set @sqlStmt=CONCAT('CREATE TEMPORARY TABLE ',@tempTableName," LIKE ",v_Tablename);
prepare stm from @sqlStmt;
execute stm;



set @sqlStmt=NULL;
set @sqlStmt=CONCAT("select t.* 
 from ",v_Tablename," t inner join cfg_imports i on (t.import_id=i.id)
 where t.campaign_id=",p_campaign,"
 and t.callinglist_id=",v_CallingListId,"
 and t.record_type=1
 and (t.record_status=1 or t.record_status=3)
 and (t.sched_time is null or t.sched_time<=CURRENT_TIMESTAMP())
 and ((current_date() between i.sched_startdate and i.sched_enddate) or (i.sched_startdate is null))
 and ((current_time() between i.sched_starttime and i.sched_endtime) or (i.sched_starttime is null))
 and i.importstatus=3
 ");


if CHAR_LENGTH(v_filterby)>0
then
	set @sqlStmt=CONCAT(@sqlStmt," ",v_filterby);
end if;


if CHAR_LENGTH(@dialPattern)>0
then
	set @sqlStmt=CONCAT(@sqlStmt," and contact_info like '",@dialPattern,"'");
end if;

if CHAR_LENGTH(v_orderby)>0
then
  set @sqlStmt=CONCAT(@sqlStmt," order by i.dialpriority desc, ",v_orderby);
else 
  set @sqlStmt=CONCAT(@sqlStmt," order by i.dialmode desc, i.dialpriority desc, i.id asc, t.chain_n asc");
end if;


set @sqlStmt=CONCAT("insert into ",@tempTableName,"(",@sqlStmt," limit 1 );");
prepare stm from @sqlStmt;
execute stm;



if (FOUND_ROWS()=0)
then 
  set @sqlStmt=null;
	set @sqlStmt=CONCAT("select t.* 
	 from ",v_Tablename," t left join cfg_imports i on (t.import_id=i.id)
	 where t.campaign_id=",p_campaign,"
   and t.callinglist_id=",v_CallingListId,"
	 and t.record_type=1 
	 and (t.record_status=1 or t.record_status=3)
   and (t.sched_time is null or t.sched_time<=CURRENT_TIMESTAMP())
   and i.id is null
 ");

	
	if CHAR_LENGTH(v_filterby)>0
  then
		set @sqlStmt=CONCAT(@sqlStmt," ",v_filterby);
  end if;

  
	if CHAR_LENGTH(@dialPattern)>0
	then
		set @sqlStmt=CONCAT(@sqlStmt," and contact_info like '",@dialPattern,"'");
	end if;

  
	if CHAR_LENGTH(v_orderby)>0
  then
     set @sqlStmt=CONCAT(@sqlStmt," order by ",v_orderby);
  end if;

	
	set @sqlStmt=CONCAT("insert into ",@tempTableName,"(",@sqlStmt," limit 1);");
	prepare stm from @sqlStmt;
	execute stm;
end if;


if (FOUND_ROWS()=0)
then 
 set @sqlStmt=CONCAT('DROP TEMPORARY TABLE IF EXISTS ',@tempTableName);
 prepare stm from @sqlStmt;
 execute stm;

 select "stopped" as retval
			,concat("la campana id=",p_campaign," en la tabla ",v_Tablename," no tiene mas registros") as retmessage;
 LEAVE selectNextRecord;
end if; 


set @sqlStmt=CONCAT("update ",@tempTableName," set contact_info=fn_regex_replace('[a-z]| ','',lower(contact_info))
                    ,chain_id=(case when (trim(chain_id)='' or lower(chain_id)='null') then NULL else chain_id end)");
prepare stm from @sqlStmt;
execute stm;


set @sqlStmt=CONCAT("UPDATE ",v_Tablename," AS t1
		INNER JOIN ",@tempTableName," AS t2 ON (t1.record_id=t2.record_id)
		SET t1.record_type=2,t1.record_status=2
    WHERE t1.campaign_id=",p_campaign,"
    AND t1.callinglist_id=",v_CallingListId);
prepare stm from @sqlStmt;
execute stm;


set @sqlStmt=CONCAT("UPDATE ",v_Tablename," AS t1
		INNER JOIN ",@tempTableName," AS t2 ON (t1.campaign_id=t2.campaign_id and t1.callinglist_id=t2.callinglist_id and t1.chain_id=t2.chain_id)
		SET t1.record_type=2,t1.record_status=1
    WHERE t1.campaign_id=",p_campaign,"
    AND t1.callinglist_id=",v_CallingListId,"
    AND t1.record_type=1
    AND not t2.chain_id is null");
prepare stm from @sqlStmt;
execute stm;


set @sqlStmt=concat("select ",@attachedFields,",'OK' as retval from ",@tempTableName);
prepare stm from @sqlStmt;
execute stm;


set @sqlStmt=CONCAT('DROP TEMPORARY TABLE ',@tempTableName);
prepare stm from @sqlStmt;
execute stm;
deallocate prepare stm;

END */;;
DELIMITER ;
