/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 PROCEDURE `sp_core_SelectRoutingDnis`(in p_dnis varchar(32))
SelectRoutingCampaign:BEGIN

declare v_TimeconditionId INT;
declare v_CampaignId INT;
declare v_CallingListId INT;
declare v_Tablename varchar(32);

drop temporary table if exists tempCampaign;
create temporary table tempCampaign as (
select cp.id as campaign_id
,case when isnull(cp.shortname) then '' else trim(cp.shortname) end as campaign_name
,cp.timecondition_id
,case when isnull(cp.externalrouting) then '' else trim(cp.externalrouting) end as external_routing
,case when isnull(cp.routingtype) then '' else trim(cp.routingtype) end as routing_type
,case when (isnull(cp.routingnumber) or cp.routingnumber='') then '0' else trim(cp.routingnumber) end as routing_number
,case when (isnull(cp.overflowtype) or cp.overflowtype='') then '0' else trim(cp.overflowtype) end as overflow_type
,case when (isnull(cp.overflownumber) or cp.overflownumber='') then '0' else trim(cp.overflownumber) end as overflow_number
,case when isnull(cp.voicelang) then '' else trim(cp.voicelang) end as voice_lang
,case when cp.monitor=true then 1 else 0 end as monitor
,case when isnull(cp.maxcalls) then '0' else cp.maxcalls end as max_calls
,case when isnull(gt.campaign_id) then '0' else '1' end as campaign_greeting
,case when isnull(gt.greeting_playtype) then '' else gt.greeting_playtype end as greeting_playtype
,case when isnull(gt.greeting_message) then '' else gt.greeting_message end as greeting_message
,case when gt.silence_detection=true then '1' else '0' end as silence_detection
,case when isnull(gt.silence_recogopts) then '' else gt.silence_recogopts end as silence_recogopts
FROM cfg_campaigns cp
INNER JOIN dnis_in_campaign ch ON cp.id=ch.campaign_id
LEFT JOIN (
				select distinct c.id as campaign_id
				,g.playtype as greeting_playtype
				,case when g.playtype='SOUND_FILE' then (select filename from cfg_soundfiles where id=m.greetingsound_id) 
							when g.playtype='TTS' then m.greetingtext
							else '' end as greeting_message
				,g.mrcp_recogopts as silence_recogopts
				,g.silencedetection as silence_detection
				from cfg_campaigns c 
				inner join cfg_greetings g on c.greeting_id=g.id
				inner join messages_in_greeting m on g.id=m.greeting_id
				where g.active=1
        and current_time() between m.start_time and m.end_time
		)as gt on (cp.id=gt.campaign_id) 
WHERE ch.dnis=p_dnis
AND cp.active=1
);

set @resultMsg=NULL;
set @resultVal=NULL;

select campaign_id,timecondition_id 
into v_CampaignId,v_TimeconditionId
from tempCampaign;

if ISNULL(v_CampaignId)
then
  set @resultMsg=CONCAT('dnis ',p_dnis,' no asignado  / camapaÃ±a no activa') ;
  set @resultVal='ERROR_NO_CAMPAIGN'; 
  select @resultVal as result_val,@resultMsg as result_msg;
  LEAVE SelectRoutingCampaign;
end if;

if NOT EXISTS(select 1 from cfg_timeconditions where id=v_TimeconditionId and active=1)
then
	set @resultMsg='la campaÃ±a no tiene horarios de gestion asignados o activos';
	set @resultVal='ERROR_NO_TIME'; 
	select * ,@resultVal as result_val,@resultMsg as result_msg 
	from tempCampaign;
  drop temporary table tempCampaign;
  LEAVE SelectRoutingCampaign;
end if;

if EXISTS(select 1 from cfg_holidays where timecondition_id=v_TimeconditionId
															and nday=DAYOFMONTH(CURRENT_DATE()) 
															and nmonth=MONTH(CURRENT_DATE()) 
															and active=1)
then
  set @resultMsg='la campaÃ±a se encuentra en dia festivo';
	set @resultVal='ERROR_NO_TIME'; 
  select * ,@resultVal as result_val,@resultMsg as result_msg 
	from tempCampaign;
  drop temporary table tempCampaign;
  LEAVE SelectRoutingCampaign;
end if;

if EXISTS(select 1 from cfg_timeconditions where id=v_TimeconditionId and startdate<>'1900-01-01 00:00:00' and enddate <>'1900-01-01 00:00:00')
then
  set @resultMsg='';
	if not EXISTS (select 1 from cfg_timeconditions where id=v_TimeconditionId and CURRENT_DATE() between startdate and enddate)
	then
		set @resultMsg='campaÃ±a fuera del rango de fechas y horarios limites';
	  set @resultVal='ERROR_NO_TIME'; 
    select * ,@resultVal as result_val,@resultMsg as result_msg 
		from tempCampaign;
		drop temporary table tempCampaign;
		LEAVE SelectRoutingCampaign;
	end if;
end if;

if not EXISTS(select 1 from cfg_schedules where timecondition_id=v_TimeconditionId 
												and wday=(case when DAYOFWEEK(now())=1 then 7 else DAYOFWEEK(now()) -1 end)
												and CURRENT_TIME() between starttime and endtime)
then
		set @resultMsg='campaÃ±a fuera del rango de horarios limites para el dia actual';
	  set @resultVal='ERROR_NO_TIME'; 
		select * ,@resultVal as result_val,@resultMsg as result_msg 
		from tempCampaign;
		drop temporary table tempCampaign;
		LEAVE SelectRoutingCampaign;
end if;

select case when isnull(cl.id) then 0 else cl.id end
,case when isnull(cl.tablename) then '' else trim(cl.tablename) end
into @callinglistId,@tablename
from callinglist_in_campaign cli
inner join cfg_callinglist cl on cli.callinglist_id=cl.id
where campaign_id=v_CampaignId
and cl.active=1
limit 1;

set @resultMsg=concat('campaÃ±a activa con dnis ',p_dnis);
set @resultVal='OK';

select *
,@callinglistId as callinglist_id
,@tablename as callinglist_name
,@resultVal as result_val
,@resultVal as result_msg
from tempCampaign;

drop temporary table tempCampaign;

END */;;
DELIMITER ;
