/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 PROCEDURE `sp_core_UpdateRecordStatus`(in p_record int
	,in p_chain varchar(16)
  ,in p_callinglist int
  ,in p_campaign int
	,in p_calltime varchar(32), in p_callresult varchar(32))
UpdateRecordStatus:BEGIN

declare v_Tablename varchar(32);
declare v_CallResult int;
declare v_MaxAttempts int;
declare v_IsReDial int;
declare v_SchedIncrement int;

SET SESSION TRANSACTION ISOLATION LEVEL READ UNCOMMITTED;

select optioncode into v_CallResult
from app_resultcodes 
where optiontype='call_result'
and lower(optionname)=lower(p_callresult);

select cl.tablename into v_Tablename
from cfg_callinglist cl 
where cl.id=p_callinglist;

if (p_calltime='')
then 
	set p_calltime=CURRENT_TIMESTAMP();
end if;

if (trim(p_chain)='' or lower(p_chain)='null')
then 
	set p_chain=NULL;
end if;

 
set @tempTableName=concat('temp_',v_Tablename);
set @sqlStmt=CONCAT('DROP TEMPORARY TABLE IF EXISTS ',@tempTableName);
prepare stm from @sqlStmt;
execute stm;

set @sqlStmt=CONCAT('CREATE TEMPORARY TABLE ',@tempTableName,' LIKE ',v_Tablename);
prepare stm from @sqlStmt;
execute stm;


if p_chain is null
then 
		set @sqlStmt=CONCAT("insert into ",@tempTableName," (
											select * from ",v_Tablename," 
											where record_id=",p_record,")");
else 
   set @sqlStmt=CONCAT("insert into ",@tempTableName," (
					select * from ",v_Tablename," 
					where campaign_id=",p_campaign," 
					and callinglist_id=",p_callinglist," 
					and chain_id='",p_chain,"')");
end if;
prepare stm from @sqlStmt;
execute stm;


if(p_callresult='ANSWER')
then 
  
	set @sqlStmt=CONCAT("update ",@tempTableName," set attempts=attempts+1
  ,record_type=3
	,record_status=4
	,call_time='",p_calltime,"'
	,call_result=",v_CallResult,"
	where record_id=",p_record);
  prepare stm from @sqlStmt;
	execute stm;

  if not p_chain is null
  then 
    
		set @sqlStmt=CONCAT("update ",@tempTableName," set record_type=3,record_status=2
		where record_type=2 and chain_id='",p_chain,"'");
		prepare stm from @sqlStmt;
		execute stm;

  end if;

  
  

else 


set @recordChainN=0;
set @sqlStmt=CONCAT("select chain_n into @recordChainN from ",@tempTableName," where record_id=",p_record);
prepare stm from @sqlStmt;
execute stm;

if @recordChainN is null 
then 
	set @recordChainN=0; 
end if;


select st.is_redial,st.sched_increment,st.max_attempts into v_IsReDial,v_SchedIncrement,v_MaxAttempts
from callinglist_in_campaign cl
inner join cfg_treatments t on cl.treatment_id=t.id
inner join statuses_in_treatment st on t.id=st.treatment_id
where cl.callinglist_id=p_callinglist
and st.call_result=v_CallResult
and FIND_IN_SET(@recordChainN,st.chain_list)>0
and t.active=1 limit 1;


if (ISNULL(v_MaxAttempts) or v_MaxAttempts<1)
then 
	select st.is_redial,st.sched_increment,st.max_attempts into v_IsReDial,v_SchedIncrement,v_MaxAttempts
	from callinglist_in_campaign cl
	inner join cfg_treatments t on cl.treatment_id=t.id
  inner join statuses_in_treatment st on t.id=st.treatment_id
	where cl.callinglist_id=p_callinglist
	and st.call_result=v_CallResult
	and st.chain_list='0'
	and t.active=1 limit 1;
end if;


if (ISNULL(v_MaxAttempts) or v_MaxAttempts<1)
then 
  set v_IsReDial=1;
	select t.max_attempts,t.sched_increment into v_MaxAttempts,v_SchedIncrement
	from callinglist_in_campaign cl
	inner join cfg_treatments t on cl.treatment_id=t.id
	where cl.callinglist_id=p_callinglist
	and t.active=1;
end if;


if (ISNULL(v_SchedIncrement) or v_SchedIncrement<1)
then 
  set v_SchedIncrement=30;
end if;

if (ISNULL(v_MaxAttempts) or v_MaxAttempts<1)
then 
  set v_IsReDial=0;
end if;

if(v_IsReDial=1)
then 


	set @sqlStmt=CONCAT("update ",@tempTableName," set attempts=attempts+1
	,call_time='",p_calltime,"'
  ,sched_time=DATE_ADD(CURRENT_TIMESTAMP(),INTERVAL ",v_SchedIncrement," MINUTE)
  ,record_type=(case when (attempts+1)>",v_MaxAttempts," then 3 else 1 end)
  ,record_status=(case when (attempts+1)>",v_MaxAttempts," then 6 else 3 end)
	,call_result=",v_CallResult," where record_id=",p_record);
  prepare stm from @sqlStmt;
	execute stm;

    if not p_chain is null 
    then  
        set @recordType=0;
				set @recordStatus=0;
				set @sqlStmt=CONCAT("select record_type,record_status into @recordType,@recordStatus from ",@tempTableName," where record_id=",p_record);
				prepare stm from @sqlStmt;
				execute stm;

        if (@recordType=1 and @recordStatus=3)
				then 
					set @recordType=2;
					set @recordStatus=1;
				else 
					set @recordType=1;
					set @recordStatus=1;
				end if;

        
				set @sqlStmt=CONCAT("update ",@tempTableName,"
				set record_type=",@recordType,",record_status=",@recordStatus,"
				where record_type=2 and chain_id='",p_chain,"'");
				prepare stm from @sqlStmt;
				execute stm;

		end if;

else 
	
  
  set @sqlStmt=CONCAT("update ",@tempTableName," set attempts=attempts+1
	,call_time='",p_calltime,"'
  ,record_type=3
  ,record_status=6
	,call_result=",v_CallResult,"
	where record_id=",p_record);
  prepare stm from @sqlStmt;
	execute stm;

  if not p_chain is null 
  then  
    
		set @sqlStmt=CONCAT("update ",@tempTableName," set record_type=1,record_status=1 
											where record_type=2 and chain_id='",p_chain,"'");
		prepare stm from @sqlStmt;
		execute stm;
  end if;

end if; 
end if; 


if p_chain is null 
then 
		set @sqlStmt=CONCAT("UPDATE ",v_Tablename," AS t1
		INNER JOIN ",@tempTableName," AS t2 ON (t1.record_id=t2.record_id)
		SET t1.record_type=t2.record_type
    ,t1.record_status=t2.record_status
    ,t1.call_result=t2.call_result
    ,t1.call_time=t2.call_time
    ,t1.sched_time=t2.sched_time
    ,t1.attempts=t2.attempts
    WHERE t1.record_id=",p_record);

    prepare stm from @sqlStmt;
		execute stm;
else 
		set @sqlStmt=CONCAT("UPDATE ",v_Tablename," AS t1
		INNER JOIN ",@tempTableName," AS t2 ON (t1.record_id=t2.record_id)
		SET t1.record_type=t2.record_type
    ,t1.record_status=t2.record_status
    ,t1.call_result=t2.call_result
    ,t1.call_time=t2.call_time
    ,t1.sched_time=t2.sched_time
    ,t1.attempts=t2.attempts
    WHERE t1.campaign_id=",p_campaign," 
    and t1.callinglist_id=",p_callinglist," 
    and t1.chain_id='",p_chain,"'");

    prepare stm from @sqlStmt;
		execute stm;
end if;

set @sqlStmt=CONCAT('DROP TEMPORARY TABLE IF EXISTS ',@tempTableName);
prepare stm from @sqlStmt;
execute stm;

END */;;
DELIMITER ;
