/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 PROCEDURE `sp_Create_Result_Report`(in p_callinglist_id INT,in p_import_ini INT,in p_import_fin INT)
BEGIN
DROP TABLE IF EXISTS tempCalls;
DROP TABLE IF EXISTS tempCalls2;
DROP TABLE IF EXISTS tempCalls3;
DROP TABLE IF EXISTS tempPres;
DROP TABLE IF EXISTS tempSiPres;
DROP TABLE IF EXISTS tempIndirectPres;
DROP TABLE IF EXISTS tempNoPres;
DROP TABLE IF EXISTS tempNoInputPres;
DROP TABLE IF EXISTS tempNoMatchPres;
DROP TABLE IF EXISTS tempSinRespPres;
DROP TABLE IF EXISTS tempFecha;
DROP TABLE IF EXISTS tempSiFecha;
DROP TABLE IF EXISTS tempNoFecha;
DROP TABLE IF EXISTS tempPagadoFecha;
DROP TABLE IF EXISTS tempNoInputFecha;
DROP TABLE IF EXISTS tempNoMatchFecha;
DROP TABLE IF EXISTS tempSinRespFecha;
select distinct l.tablename 
into @tablename 
from cfg_callinglist l 
where l.id=p_callinglist_id;

if p_import_fin is null or p_import_fin = '' then set p_import_fin=p_import_ini; end if;

set @sqlStmt=concat(" create temporary table tempCalls as( 
select distinct 
date(call_time) as fecha_llamada,
upper(concat(nombre,' ',apellido_pat)) as NOMBRE , 
contact_info , 
a.chain_id,
b.code_name as optionname,
gc.duration,
gc.billsec,
gc.linkedid,
gc.connid,
gc.call_result
from ",@tablename," a
left join v_callresult b
on a.call_result = b.code_enum
right join global_call gc
on a.contact_info=gc.dst and a.record_id = gc.record_id and a.import_id=gc.import_id
where a.import_id between ",p_import_ini," and ",p_import_fin,
")");

PREPARE stmt FROM @sqlStmt;
EXECUTE stmt;

create temporary table tempCalls2 as select distinct chain_id from tempCalls where call_result in (5,14,15);

create temporary table tempCalls3 as select distinct chain_id from tempCalls where chain_id not in (select distinct chain_id from tempCalls2);


create temporary table tempPres as (
select distinct distinct upper(b0.cdata01) as NOMBRE,b0.phone, b0.chain_id,b0.response_code as PregNombre, b0.uniqueid,b0.connid 
   from logs_survey_interactions b0
   inner join
    (
		select max(attempt) as max_attempt , phone, chain_id, uniqueid,connid 
		  from logs_survey_interactions x 
		 where import_id between p_import_ini and p_import_fin 
		   and upper(question_name) in ('PREGNOMBRE')
	  group by phone, chain_id, uniqueid,connid 
      ) b1
	on b0.phone = b1.phone and b0.chain_id = b1.chain_id and b0.attempt = b1.max_attempt and b0.uniqueid=b1.uniqueid and b0.connid=b1.connid
	 where import_id between p_import_ini and p_import_fin 
		and upper(question_name) in ('PREGNOMBRE') 
);


create temporary table tempFecha as (
select distinct distinct upper(c0.cdata01) as NOMBRE,c0.phone, c0.chain_id,c0.response_code as PregFecha, c0.uniqueid,c0.connid,c0.cdata02
   from logs_survey_interactions c0
   inner join
    (
		select max(attempt) as max_attempt , phone, chain_id,uniqueid,connid 
		  from logs_survey_interactions x 
		 where import_id between p_import_ini and p_import_fin 
		   and upper(question_name) in ('PREGFECHA') 
	  group by phone, chain_id,uniqueid,connid 
      ) c1
	on c0.phone = c1.phone and c0.chain_id = c1.chain_id and c0.attempt = c1.max_attempt and c0.uniqueid=c1.uniqueid and c0.connid=c1.connid
	 where import_id between p_import_ini and p_import_fin 
		and upper(question_name) in ('PREGFECHA') 
);


create temporary table tempSiPres as select distinct chain_id from tempPres where PregNombre='si';

create temporary table tempIndirectPres as select distinct PregNombre,chain_id from tempPres where PregNombre in('de_parte_de','no_se_encuentra') and chain_id not in (select distinct chain_id from tempSiPres);



insert into tempSiPres (select distinct chain_id from tempIndirectPres where chain_id in (select distinct chain_id from tempFecha) and PregNombre in('de_parte_de'));
delete from tempIndirectPres where chain_id in (select distinct chain_id from tempFecha) and PregNombre in('de_parte_de');
delete from tempIndirectPres where chain_id in (select distinct chain_id from tempSiPres);


create temporary table tempNoPres as select distinct chain_id from tempPres 
where PregNombre='no' 
and chain_id not in (select distinct chain_id from tempSiPres) 
and chain_id not in (select distinct chain_id from tempIndirectPres) ;


create temporary table tempNoInputPres as select distinct chain_id from tempPres 
where PregNombre='NOINPUT' 
and chain_id not in (select distinct chain_id from tempSiPres) 
and chain_id not in (select distinct chain_id from tempIndirectPres) 
and chain_id not in (select distinct chain_id from tempNoPres) ;


create temporary table tempNoMatchPres as select distinct chain_id from tempPres 
where PregNombre='NOMATCH' 
and chain_id not in (select distinct chain_id from tempSiPres) 
and chain_id not in (select distinct chain_id from tempIndirectPres) 
and chain_id not in (select distinct chain_id from tempNoPres)  
and chain_id not in (select distinct chain_id from tempNoInputPres);


create temporary table tempSinRespPres as 
select distinct chain_id from tempCalls2 
where chain_id not in (select distinct chain_id from tempPres)
and chain_id not in (select distinct chain_id from tempFecha)
and chain_id not in (select distinct chain_id from tempCalls3);


create temporary table tempSiFecha as select distinct chain_id from tempFecha 
where (PregFecha in('true','mayor') or PregFecha like '201%')
and cdata02 not like '196%'
;


create temporary table tempNoFecha as 
select distinct chain_id from tempFecha where PregFecha in('NoPagara:NP','no se')
and chain_id not in (select distinct chain_id from tempSiFecha);


create temporary table tempPagadoFecha as 
select distinct chain_id from tempFecha where PregFecha in('Pagado:PA')
and chain_id not in (select distinct chain_id from tempSiFecha)
and chain_id not in (select distinct chain_id from tempNoFecha);


create temporary table tempNoInputFecha as select distinct chain_id from tempFecha 
where PregFecha='NOINPUT' 
and chain_id not in (select distinct chain_id from tempSiFecha) 
and chain_id not in (select distinct chain_id from tempNoFecha) 
and chain_id not in (select distinct chain_id from tempPagadoFecha) ;


create temporary table tempNoMatchFecha as select distinct chain_id from tempFecha 
where (PregFecha in('NOMATCH' ,'-1','-2') or PregFecha like '{%')
and chain_id not in (select distinct chain_id from tempSiFecha) 
and chain_id not in (select distinct chain_id from tempNoFecha) 
and chain_id not in (select distinct chain_id from tempPagadoFecha)  
and chain_id not in (select distinct chain_id from tempNoInputFecha);


create temporary table tempSinRespFecha as 
select distinct chain_id from tempSiPres 
where chain_id not in (select distinct chain_id from tempFecha);


select 'Ruts Totales: ' as titulo,count(distinct chain_id) as cantidad from tempCalls
union
select 'Ruts Contestan: ' as titulo,count(distinct chain_id) as cantidad from tempCalls2
union
select 'Ruts No Contestan: ' as titulo,count(distinct chain_id) as cantidad from tempCalls3
union
select 'Ruts Dicen Si en Nombre: ' as titulo,count(distinct chain_id) as cantidad from tempSiPres
union
select 'Ruts Contacto Indirecto en Nombre: ' as titulo,count(distinct chain_id) as cantidad from tempIndirectPres
union
select 'Ruts Dicen No en Nombre: ' as titulo,count(distinct chain_id) as cantidad from tempNoPres
union
select 'Ruts con NOINPUT en Nombre: ' as titulo,count(distinct chain_id) as cantidad from tempNoInputPres
union
select 'Ruts con NOMATCH en Nombre: ' as titulo,count(distinct chain_id) as cantidad from tempNoMatchPres
union
select 'Ruts con llamada terminada en Nombre: ' as titulo,count(distinct chain_id) as cantidad from tempSinRespPres
union
select 'Ruts comprometen Fecha de Pago: ' as titulo,count(distinct chain_id) as cantidad from tempSiFecha
union
select 'Ruts que dicen que no pagaran: ' as titulo,count(distinct chain_id) as cantidad from tempNoFecha
union
select 'Ruts que dicen que ya pagaron: ' as titulo,count(distinct chain_id) as cantidad from tempPagadoFecha
union
select 'Ruts con NOINPUT en Fecha de Pago: ' as titulo,count(distinct chain_id) as cantidad from tempNoInputFecha
union
select 'Ruts con NOMATCH en Fecha de Pago: ' as titulo,count(distinct chain_id) as cantidad from tempNoMatchFecha
union
select 'Ruts con llamada terminada en Fecha de Pago: ' as titulo,count(distinct chain_id) as cantidad from tempSinRespFecha;

DROP TABLE IF EXISTS tempCalls;
DROP TABLE IF EXISTS tempCalls2;
DROP TABLE IF EXISTS tempCalls3;
DROP TABLE IF EXISTS tempPres;
DROP TABLE IF EXISTS tempSiPres;
DROP TABLE IF EXISTS tempIndirectPres;
DROP TABLE IF EXISTS tempNoPres;
DROP TABLE IF EXISTS tempNoInputPres;
DROP TABLE IF EXISTS tempNoMatchPres;
DROP TABLE IF EXISTS tempSinRespPres;
DROP TABLE IF EXISTS tempFecha;
DROP TABLE IF EXISTS tempSiFecha;
DROP TABLE IF EXISTS tempNoFecha;
DROP TABLE IF EXISTS tempPagadoFecha;
DROP TABLE IF EXISTS tempNoInputFecha;
DROP TABLE IF EXISTS tempNoMatchFecha;
DROP TABLE IF EXISTS tempSinRespFecha;
END */;;
