/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 PROCEDURE `sp_getHistoricoGestionCliente`(in p_cliente varchar(50))
begin
select distinct
l0.crr_time as Fecha_Llamada,
l0.cdata03 as user_agente,
l0.chain_id as NCliente,
l0.cdata02 as NombreCliente,
l0.phone as Telefono,
fn_TraduceCodigoTermino(l1.cdata01) as Tipificacion,
fn_TraducePregNombre(l1.response_code) as PregNombre,
ifnull(l2.response_code,'') as EnvioCotizacion,
ifnull(l1.cdata04,'') as Observaciones
from
(
select * from logs_survey_interactions_web_page
) l0
left join
(
select * from logs_survey_interactions_web_page
where (question_name in ('PregNombre') or question_name is null)
) l1
on l0.record_id=l1.record_id and l0.connid=l1.connid
left join 
(
select * from logs_survey_interactions_web_page
where (question_name in ('PregCotiza') or question_name is null) 
) l2
on l0.record_id=l2.record_id and l0.connid=l2.connid
where l0.chain_id= p_cliente
order by l0.crr_time desc;
end */;;
