/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 PROCEDURE `sp_getListHeaderBeco`(p_fecha_ini date,p_fecha_fin date)
begin

declare v_import_id_ini int;
declare v_import_id_fin int;
declare v_callinglist_id int;
declare v_archivo varchar(64);

drop TEMPORARY table if exists respuestas_beco;
drop TEMPORARY table if exists productos_en_fila;

drop TEMPORARY table if exists detalle_respuestas_lineal;
DROP TEMPORARY table if exists detalle_ct_global_call;


set v_archivo = concat('/tmp/list_header_alteor_',date(p_fecha_ini),'.txt');

select distinct min(import_id) import_id_ini,max(import_id) import_id_fin,callinglist_id 
into v_import_id_ini,v_import_id_fin,v_callinglist_id
from global_call where date(start_time) between date(p_fecha_ini) and date(p_fecha_fin)
and callinglist_id=19
group by callinglist_id;

create temporary table respuestas_beco as
select b.chain_id,
b.phone,
b.PregNombre,
c.PregFecha1,
d.PregFecha2,
b.uniqueid,
b.connid,

c.FechaCompromiso1,
d.FechaCompromiso2,
c.Pregunta1,
c.recog_confidence1,
c.recog_utterance_1,
d.Pregunta2,
d.recog_confidence2,
d.recog_utterance_2
from
(select distinct distinct b0.phone, b0.chain_id,b0.response_code as PregNombre, b0.uniqueid,b0.connid
   from logs_survey_interactions b0
   inner join
    (
		select max(attempt) as max_attempt , phone, chain_id, uniqueid,connid 
		  from logs_survey_interactions x 
		 where import_id between v_import_id_ini and v_import_id_fin and callinglist_id=v_callinglist_id
		   and upper(question_name) in ('PREGNOMBRE') 
	  group by phone, chain_id, uniqueid,connid 
      ) b1
	on b0.phone = b1.phone and b0.chain_id = b1.chain_id and b0.attempt = b1.max_attempt and b0.uniqueid=b1.uniqueid and b0.connid=b1.connid
	 where import_id between v_import_id_ini and v_import_id_fin and callinglist_id=v_callinglist_id
		and upper(question_name) in ('PREGNOMBRE') 
 ) b   
left join         
(select distinct c0.phone, c0.chain_id,c0.response_code as PregFecha1, c0.uniqueid,c0.connid,
				 c0.cdata02 as FechaCompromiso1,c0.cdata03 as Producto, 
                 upper(c0.question_name) as Pregunta1,
                 c0.recog_confidence as recog_confidence1,c0.recog_utterance as recog_utterance_1  
   from logs_survey_interactions c0
   inner join
    (
		select max(attempt) as max_attempt , phone, chain_id,uniqueid,connid 
		  from logs_survey_interactions x 
		 where import_id between v_import_id_ini and v_import_id_fin and callinglist_id=v_callinglist_id
		   and upper(question_name) in ('PREGFECHA1') 
	  group by phone, chain_id,uniqueid,connid 
      ) c1
	on c0.phone = c1.phone and c0.chain_id = c1.chain_id and c0.attempt = c1.max_attempt and c0.uniqueid=c1.uniqueid and c0.connid=c1.connid
	 where import_id between v_import_id_ini and v_import_id_fin and callinglist_id=v_callinglist_id
		and upper(question_name) in ('PREGFECHA1') 
) c
on b.phone = c.phone and b.uniqueid=c.uniqueid and b.connid=c.connid 
left join         
(select distinct d0.phone, d0.chain_id,d0.response_code as PregFecha2, d0.uniqueid,d0.connid,
				 d0.cdata02 as FechaCompromiso2,d0.cdata03 as Producto, 
                 upper(d0.question_name) as Pregunta2,
                 d0.recog_confidence as recog_confidence2,d0.recog_utterance as recog_utterance_2
   from logs_survey_interactions d0
   inner join
    (
		select max(attempt) as max_attempt , phone, chain_id,uniqueid,connid 
		  from logs_survey_interactions x 
		 where import_id between v_import_id_ini and v_import_id_fin and callinglist_id=v_callinglist_id
		   and upper(question_name) in ('PREGFECHA2') 
	  group by phone, chain_id,uniqueid,connid 
      ) d1
	on d0.phone = d1.phone and d0.chain_id = d1.chain_id and d0.attempt = d1.max_attempt and d0.uniqueid=d1.uniqueid and d0.connid=d1.connid
	 where import_id between v_import_id_ini and v_import_id_fin and callinglist_id=v_callinglist_id
		and upper(question_name) in ('PREGFECHA2') 
) d
on b.phone = d.phone and b.uniqueid=d.uniqueid and b.connid=d.connid 
;

create temporary table productos_en_fila as
select a.callinglist_id,a.import_id,a.record_chain,
a.prod_order as nro_prod_1,a.prod_cod codigo_producto_1,a.prod_nombre nombre_producto_1,a.prod_tipo tipo_producto_1,a.monto_deuda monto_producto_1,a.fecha_vence fecha_vence_producto_1,a.cantidad_cuotas as cantidad_cuotas_1,
b.prod_order as nro_prod_2,b.prod_cod codigo_producto_2,b.prod_nombre nombre_producto_2,b.prod_tipo tipo_producto_2,b.monto_deuda monto_producto_2,b.fecha_vence fecha_vence_producto_2,b.cantidad_cuotas as cantidad_cuotas_2,
c.prod_order as nro_prod_3,c.prod_cod codigo_producto_3,c.prod_nombre nombre_producto_3,c.prod_tipo tipo_producto_3,c.monto_deuda monto_producto_3,c.fecha_vence fecha_vence_producto_3,c.cantidad_cuotas as cantidad_cuotas_3
from 
(select * from product_in_callinglist a0 where a0.prod_order in(1) and  a0.import_id between v_import_id_ini and v_import_id_fin and a0.callinglist_id=v_callinglist_id)  a
left join
(select * from product_in_callinglist b0 where b0.prod_order=2 and  b0.import_id between v_import_id_ini and v_import_id_fin and b0.callinglist_id=v_callinglist_id) b
on a.record_chain=b.record_chain
left join
(select * from product_in_callinglist c0 where c0.prod_order=3 and  c0.import_id between v_import_id_ini and v_import_id_fin and c0.callinglist_id=v_callinglist_id) c
on a.record_chain=c.record_chain;

create temporary table detalle_respuestas_lineal
select distinct
a.chain_id,
a.phone,
a.PregNombre,
a.PregFecha1,
