create TEMPORARY table detalle_respuestas_lineal as
select x.* from (
select distinct
p1.phone,
p1.uniqueid,
p1.connid,
p1.pregNombre,
fn_getCompromiso(ifnull(p1.PregFecha1Prod1,''),ifnull(p1.PregFecha2Prod1,''),p1.FechaCompromiso1,p1.FechaCompromiso2) as Valor_Compromiso1,
