/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 PROCEDURE `sp_SelectPayDateCondition`(in p_date varchar(32), in p_campaign int)
valPayDateCondition:begin 


declare v_keyWord VARCHAR(16);

set @pDate=DATE(p_date);
set @pDay=DAY(@pDate);
set @pMonth=MONTH(@pDate);
set @pWDay=DAYOFWEEK(@pDate);


set @active=NULL;
select 1 into @active from cfg_datepay_conditions
where campaign_id=p_campaign
and active=1;

if(@active is null)
then 
	set v_keyWord='habil';
  select v_keyWord as 'keyWord';
	LEAVE valPayDateCondition;
end if;

set @isValDay=0;
if(@pWDay=2) 
then 
	select mon into @isValDay from cfg_datepay_conditions 
	where campaign_id=p_campaign;

elseif(@pWDay=3) 
then 
	select tue into @isValDay from cfg_datepay_conditions 
	where campaign_id=p_campaign;

elseif(@pWDay=4) 
then 
	select wed into @isValDay from cfg_datepay_conditions 
	where campaign_id=p_campaign;

elseif(@pWDay=5) 
then 
	select thu into @isValDay from cfg_datepay_conditions 
	where campaign_id=p_campaign;

elseif(@pWDay=6) 
then 
	select fra into @isValDay from cfg_datepay_conditions 
	where campaign_id=p_campaign;

elseif(@pWDay=7) 
then 
	select sat into @isValDay from cfg_datepay_conditions 
	where campaign_id=p_campaign;

elseif(@pWDay=1) 
then 
	select sun into @isValDay from cfg_datepay_conditions 
	where campaign_id=p_campaign;

end if;

if(@isValDay=1)
then 
  set v_keyWord='habil';
	if exists(select 1 from cfg_datepay_conditions where current_day_only=1)
	then 
      set @crrDay=DAY(CURRENT_DATE());
			if(@pDay > @crrDay) then set v_keyWord='mayor'; end if;

	elseif exists(select 1 from cfg_datepay_conditions where current_week_only=1) 
  then 
       set @crrDay=DAY(CURRENT_DATE());
			if(@pDay > (@crrDay+5)) then set v_keyWord='mayor'; end if;

  elseif exists(select 1 from cfg_datepay_conditions where current_month_only=1) 
	then 
      set @crrMonth=MONTH(CURRENT_DATE());
			if(@pMonth > @crrMonth) then set v_keyWord='mayor'; end if;
	
	end if;

else 
	set v_keyWord='nohabil';

end if;

select v_keyWord as 'keyWord';

end */;;
DELIMITER ;
