/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 PROCEDURE `sp_survey_InsertLogsInteraction`(in p_uid varchar(32),
  in p_connid varchar(64),  
  in p_phone varchar(32),	
  in p_campaign int,	
  in p_callinglist int,	
	in p_record bigint,	
  in p_import int,	
  in p_chain varchar(16),		
	in p_eventname varchar(12),	
	in p_survey int,						
	in p_question int,			
  in p_attempt int,			
	in p_response varchar(16),	
  in p_inputType varchar(16),
  in p_recogUtt varchar(32),
  in p_recogConf varchar(4), 
  in p_cdata01 varchar(64),	
	in p_cdata02 varchar(64),	
	in p_cdata03 varchar(64),	
	in p_cdata04 varchar(64),	
	in p_cdata05 varchar(64))
BEGIN

declare v_surveyDnis varchar(32);
declare v_surveyName varchar(32);
declare v_questionName varchar(32);
declare v_questionNum int;
declare v_questionText varchar(255);
declare v_responseText varchar(32);
declare v_questionType varchar(32);

select s.dnis,s.shortname 
into v_surveyDnis,v_surveyName  
from cfg_surveys s where s.id=p_survey;

select q.shortname,q.questiontext,q.questionnum
into v_questionName,v_questionText,v_questionNum
from cfg_questions q where q.id=p_question;



if p_eventname='next' 
then
	select r.responsetext into v_responseText
	from responses_in_questions r 
  where r.question_id=p_question 
	and r.responsecode=p_response;

	if v_responseText is null 
  then
		set v_responseText='Invalid';
	end if;
end if;

if (p_recogConf='' or p_recogConf is null)
then 
	set p_recogConf='0.0';
end if;

set @recogConf=(p_recogConf*100);

insert into logs_survey_interactions
(
  phone,
  uniqueid,
  connid,
  campaign_id,
  import_id,
  callinglist_id,
  record_id,
	chain_id,
	eventname,
	survey_id,
  survey_dnis,
	survey_name,
	question_id,
	question_name,
	question_text,
	question_num,
  attempt, 
	response_code,
	response_text,
  input_type,
  recog_confidence,
  recog_utterance,
  cdata01,
  cdata02,
  cdata03,
  cdata04,
  cdata05
)
values
(
  p_phone,
  p_uid,
  p_connid,
  p_campaign,
  p_import,
  p_callinglist,
  p_record,
	p_chain,
	p_eventname,
	p_survey,
  v_surveyDnis,
	v_surveyName,
	p_question,
	v_questionName,
	v_questionText,
	v_questionNum,
  p_attempt,
	p_response,
	v_responseText,
  p_inputType, 
  @recogConf,
  p_recogUtt,
  p_cdata01,
  p_cdata02,
  p_cdata03,
  p_cdata04,
  p_cdata05
);


END */;;
DELIMITER ;
