/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 PROCEDURE `sp_survey_SelectKeywordMapper`(in p_keyword varchar(64))
BEGIN

declare v_sayAsTTS varchar(64);
declare v_sayAsFileName varchar(128);

select sayas_tts,sayas_filename into v_sayAsTTS,v_sayAsFileName 
from content_keyword_mapper
where LOWER(keyword)=LOWER(p_keyword);

if v_sayAsFileName is null 
then  
	set v_sayAsFileName='';
end if;

if v_sayAsTTS is null 
then 
	insert into content_keyword_mapper (keyword,sayas_tts,lastcount)
  values(p_keyword, p_keyword, 1);
  
  set v_sayAsTTS=p_keyword;
else 
  update content_keyword_mapper 
	set lastcount=lastcount+1
			,crr_time=CURRENT_TIMESTAMP()
  where keyword=p_keyword;
end if;

select v_sayAsTTS as 'sayas_tts'
,v_sayAsFileName as 'sayas_filename';

END */;;
DELIMITER ;
