/*!50003 CREATE*/ /*!50020 DEFINER=`admin`@`%`*/ /*!50003 PROCEDURE `sp_survey_SelectNextQuestion`(in p_dnis varchar(32),
	in p_survey int,
	in p_question int,
	in p_response varchar(32), in p_attempt int)
selectNExtQuestion:BEGIN

declare v_responseResult varchar(32);
declare v_retryMessage varchar(255);
declare v_retryMrcpOpts varchar(128);
declare v_retryPlayType varchar(32);
declare v_retryConfidenceLevel int;

drop temporary table if exists tempQuestion;
drop temporary table if exists tempSurvey;

set v_responseResult='';
set v_retryMessage='';
set v_retryMrcpOpts='';
set v_retryPlayType='';
set v_retryConfidenceLevel=0;

if p_survey=0 
then 
	select id into p_survey from cfg_surveys where dnis=p_dnis and active=1;
	if (ISNULL(p_survey) or p_survey=0)
	then 
    
		select '0' as 'gosub_onenter'
				,'0' as 'gosub_onexit'
				,'finalize' as 'response_result';
		leave selectNExtQuestion;
	end if;
end if;


CREATE TEMPORARY TABLE tempSurvey 
AS(
		select e.id as survey_id
		,e.shortname as survey_name
		,e.dnis as survey_dnis
    ,e.playtype as survey_playtype
    ,case when e.playfarewell=1 then 1 else 0 end as farewell
		,case when e.playtype='SOUND_FILE' then (select filename from cfg_soundfiles where id=e.farewellsound_id)
						when e.playtype='SOUND_COMPLEX' then (select complex_message from cfg_soundcomplex where id=e.farewellsound_id) 
						else e.farewelltext end as farewell_message
    ,case when e.autogreeting=1 then 1 else 0 end as autogreeting
    ,e.mrcp_synthopts as mrcp_synth_opts
		,e.mrcp_recogopts as mrcp_recog_opts
		from cfg_surveys e
		where e.id=p_survey
);

set @sqlStmt=null;
set @sqlStmt=concat("CREATE TEMPORARY TABLE tempQuestion AS (
			select q.id as question_id
      ,q.playtype as question_playtype
			,case when q.playtype='SOUND_FILE' then (select filename from cfg_soundfiles where id=q.questionsound_id)
						when q.playtype='SOUND_COMPLEX' then (select complex_message from cfg_soundcomplex where id=q.questionsound_id) 
						else q.questiontext end as question_message
      ,q.inputtype as input_type
			,case when q.maxattempts>0 then q.maxattempts else e.maxattempts end max_attempts
			,case when q.maxwaittime>0 then q.maxwaittime else e.maxwaittime end max_waittime
      ,case when q.maxdigits is null then 0 else q.maxdigits end max_digits
      ,q.grammar as grammar_name
      ,case when q.gosub_onenter=1 then 1 else 0 end as gosub_onenter
			,case when q.gosub_onenter=1 then replace(q.gosub_onenterdata,'(',',s,1(') else 'NULL' end as gosub_onenter_data
			,case when q.gosub_onexit=1 then 1 else 0 end as gosub_onexit
			,case when q.gosub_onexit=1 then replace(q.gosub_onexitdata,'(',',s,1(') else 'NULL' end as gosub_onexit_data
			,q.mrcp_opts as mrcp_opts
			,case when q.confidencelevel>0 then q.confidencelevel else e.confidencelevel end as confidence_level
      ,q.trxresource as trx_resource
			,q.trxdst as trx_dst
			,case when q.trxtimeout is null then 0 else q.trxtimeout end as trx_timeout
      ,case when LENGTH(q.exec_subrutine)>0 then replace(q.exec_subrutine,'(',',s,1(') else 'NULL' end as exec_subrutine
      ,q.qvarname as qvarname
			from cfg_surveys e
			inner join cfg_questions q on e.id=q.survey_id
			where e.id=",p_survey);


IF p_question=0
THEN
   set @sqlStmt=concat(@sqlStmt," and q.questionnum=1);");
	 set v_responseResult='continue';
	 
ELSE
    
    set @matchValue=0;
    select if (exists(select * from responses_in_questions r 
		inner join cfg_questions q on r.question_id=q.id
		where q.survey_id=p_survey
		and q.id=p_question
		and r.responsecode=p_response),1,0) into @matchValue;
		
    
		
    if (isnull(@matchValue) or @matchValue=0)
    then
				select count(*) into @matchValue
				from cfg_questions q
        inner join retry_in_questions r on q.id=r.question_id
        where q.id=p_question
				and r.attempt_type=p_response
				and r.attempt_num=p_attempt;
   
				if (isnull(@matchValue) or @matchValue=0)
				then 
						set p_response='NOMATCH';
				end if;
				
				
        set @nextnode=0;
				select case when r.playtype='SOUND_FILE' then (select filename from cfg_soundfiles where id=r.retry_messagesound_id)
						when r.playtype='SOUND_COMPLEX' then (select complex_message from cfg_soundcomplex where id=r.retry_messagesound_id) 
						else r.retry_messagetext end as retry_messagetext
            ,r.playtype
						,r.mrcp_opts
						,r.confidencelevel
						,r.goto_onsuccess
				into v_retryMessage,v_retryPlayType,v_retryMrcpOpts,v_retryConfidenceLevel,@nextnode
        from cfg_questions q
        inner join retry_in_questions r on q.id=r.question_id
        where q.id=p_question
				and r.attempt_type=p_response
				and r.attempt_num=p_attempt;

				if v_retryMessage is null then set v_retryMessage=''; end if;
				if v_retryPlayType is null then set v_retryPlayType=''; end if;
				if v_retryMrcpOpts is null then set v_retryMrcpOpts=''; end if;
				if v_retryConfidenceLevel is null then set v_retryConfidenceLevel=0; end if;

				
				if (@nextnode is null or @nextnode=0) 
        then
          set @sqlStmt=CONCAT(@sqlStmt," and q.id=",p_question,");");
					set v_responseResult='retry';
				else 
					set @sqlStmt=CONCAT(@sqlStmt," and q.id=",@nextnode,");");
          set v_retryMessage='';
          set v_responseResult='continue';
				end if;

    else 
				
				
				select r.goto_onsuccess into @nextnode 
        from responses_in_questions r 
				inner join cfg_questions q on r.question_id=q.id
				where q.survey_id=p_survey
				and q.id=p_question
				and r.responsecode=p_response;
        
				
        if (isnull(@nextnode) or @nextnode=0) 
        then
					set @sqlStmt=CONCAT(@sqlStmt," and q.questionnum=(select q2.questionnum+1 from cfg_questions q2 where q2.id=",p_question,") );");
				else 
					set @sqlStmt=CONCAT(@sqlStmt," and q.id=",@nextnode,");");
				end if;

				set v_responseResult='continue';
		end if;

END IF;

prepare stm from @sqlStmt;
execute stm;

if ((select count(*) from tempQuestion)=0)
then
		select '0' as 'gosub_onenter'
				,'0' as 'gosub_onexit'
				,'finalize' as 'response_result';
else
    if (v_responseResult='retry')
		then 
			update tempQuestion 
			set question_message=case when v_retryMessage='' then question_message else v_retryMessage end
      ,question_playtype=case when v_retryPlayType='' then question_playtype else v_retryPlayType end
      ,mrcp_opts=case when v_retryMrcpOpts='' then mrcp_opts else v_retryMrcpOpts end
      ,confidence_level=case when v_retryConfidenceLevel>0 then v_retryConfidenceLevel else confidence_level end
			;
		end if;

		select s.*,q.*,v_responseResult as 'response_result' 
		from tempSurvey s,tempQuestion q;
end if;

drop temporary table if exists tempQuestion;
drop temporary table if exists tempSurvey;

END */;;
